        <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n            <choose>\n               <if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n                  <text variable=\"title\" form=\"short\" font-style=\"italic\"/>\n               </if>\n               <else>\n                  <text variable=\"title\" form=\"short\" quotes=\"true\"/>\n               </else>\n            </choose>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"access\">\n      <choose>\n         <if type=\"thesis\">\n            <choose>\n               <if variable=\"archive\" match=\"any\">\n                  <group>\n                     <text term=\"retrieved\" text-case=\"capitalize-first\" suffix=\" \"/>\n                     <text term=\"from\" suffix=\" \"/>\n                     <text variable=\"archive\" suffix=\".\"/>\n                     <text variable=\"archive_location\" prefix=\" (\" suffix=\")\"/>\n                  </group>\n               </if>\n               <else>\n                  <group>\n                     <text term=\"retrieved\" text-case=\"capitalize-first\" suffix=\" \"/>\n                     <text term=\"from\" suffix=\" \"/>\n                     <text variable=\"URL\"/>\n                  </group>\n               </else>\n            </choose>\n         </if>\n         <else>\n            <choose>\n               <if variable=\"DOI\">\n                  <text variable=\"DOI\" prefix=\"doi:\"/>\n               </if>\n               <else>\n                  <choose>\n                     <if type=\"webpage\">\n                        <group>\n                           <text term=\"retrieved\" text-case=\"capitalize-first\" suffix=\" \"/>\n                           <date variable=\"accessed\" suffix=\", \">\n                              <date-part name=\"month\" suffix=\" \"/>\n                              <date-part name=\"day\" suffix=\", \"/>\n                              <date-part name=\"year\"/>\n                           </date>\n                           <group>\n                              <text term=\"from\" suffix=\" \"/>\n                              <text variable=\"URL\"/>\n                           </group>\n                        </group>\n                     </if>\n                     <else>\n                        <group>\n                           <text term=\"retrieved\" text-case=\"capitalize-first\" suffix=\" \"/>\n                           <text term=\"from\" suffix=\" \"/>\n                           <text variable=\"URL\"/>\n                        </group>\n                     </else>\n                  </choose>\n               </else>\n            </choose>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"title\">\n      <choose>\n         <if type=\"report thesis\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\"/>\n            <group prefix=\" (\" suffix=\")\">\n               <text variable=\"genre\"/>\n               <text variable=\"number\" prefix=\" No. \"/>\n            </group>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song manuscript speech\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\"/>\n         </else-if>\n         <else>\n            <text variable=\"title\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"publisher\">\n      <choose>\n         <if type=\"report\" match=\"any\">\n            <group delimiter=\": \">\n               <text variable=\"publisher-place\"/>\n               <text variable=\"publisher\"/>\n            </group>\n         </if>\n         <else-if type=\"thesis\" match=\"any\">\n            <group delimiter=\", \">\n               <text variable=\"publisher\"/>\n               <text variable=\"publisher-place\"/>\n            </group>\n         </else-if>\n         <else>\n            <choose>\n               <if variable=\"event\" match=\"none\">\n                  <text variable=\"genre\" suffix=\", \"/>\n               </if>\n            </choose>\n            <group delimiter=\": \">\n               <text variable=\"publisher-place\"/>\n               <text variable=\"publisher\"/>\n            </group>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"event\">\n      <choose>\n         <if variable=\"event\">\n            <choose>\n               <if variable=\"genre\" match=\"none\">\n                  <text term=\"presented at\" text-case=\"capitalize-first\" suffix=\" \"/>\n                  <text variable=\"event\"/>\n               </if>\n               <else>\n                  <group delimiter=\" \">\n                     <text variable=\"genre\" text-case=\"capitalize-first\"/>\n                     <text term=\"presented at\"/>\n                     <text variable=\"event\"/>\n                  </group>\n               </else>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"issued\">\n      <choose>\n         <if variable=\"issued\">\n            <group prefix=\" (\" suffix=\").\">\n               <date variable=\"issued\">\n                  <date-part name=\"year\"/>\n               </date>\n               <choose>\n                  <if type=\"bill book graphic legal_case motion_picture report song article-journal chapter paper-conference\" match=\"none\">\n                     <date variable=\"issued\">\n                        <date-part prefix=\", \" name=\"month\"/>\n                        <date-part prefix=\" \" name=\"day\"/>\n                     </date>\n                  </if>\n               </choose>\n            </group>\n         </if>\n         <else>\n            <text prefix=\" (\" term=\"no date\" suffix=\").\" form=\"short\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"issued-year\">\n      <choose>\n         <if variable=\"issued\">\n            <date variable=\"issued\">\n               <date-part name=\"year\"/>\n            </date>\n         </if>\n         <else>\n            <text term=\"no date\" form=\"short\" strip-periods=\"true\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"edition\">\n      <choose>\n         <if is-numeric=\"edition\">\n            <group delimiter=\" \">\n               <number variable=\"edition\" form=\"ordinal\"/>\n               <text term=\"edition\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n            </group>\n         </if>\n         <else>\n            <text variable=\"edition\" suffix=\".\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"locators\">\n      <choose>\n         <if type=\"article-journal article-magazine article-newspaper\" match=\"any\">\n            <group prefix=\", \" delimiter=\", \">\n               <group>\n                  <text variable=\"volume\" font-style=\"italic\"/>\n                  <text variable=\"issue\" prefix=\"(\" suffix=\")\"/>\n               </group>\n               <text variable=\"page\"/>\n            </group>\n         </if>\n         <else-if type=\"patent\">\n           <group prefix=\". \">\n             <group>\n               <text variable=\"section\" suffix=\" Patent No.\"/>\n               <text variable=\"volume\" prefix=\" \" font-style=\"italic\"/>\n               <text variable=\"issue\" prefix=\". \"/>\n             </group>\n           </group>\n         </else-if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <group prefix=\" (\" suffix=\")\" delimiter=\", \">\n               <text macro=\"edition\"/>\n               <group>\n                  <text term=\"volume\" form=\"short\" plural=\"true\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n                  <number variable=\"number-of-volumes\" form=\"numeric\" prefix=\"1-\"/>\n               </group>\n               <group>\n                  <text term=\"volume\" form=\"short\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n                  <number variable=\"volume\" form=\"numeric\"/>\n               </group>\n               <group>\n                  <label variable=\"page\" form=\"short\" suffix=\" \"/>\n                  <text variable=\"page\"/>\n               </group>\n            </group>\n         </else-if>\n      </choose>\n   </macro>\n   <macro name=\"citation-locator\">\n      <group>\n         <label variable=\"locator\" form=\"short\"/>\n         <text variable=\"locator\" prefix=\" \"/>\n      </group>\n   </macro>\n   <citation et-al-min=\"6\" et-al-use-first=\"1\" et-al-subsequent-min=\"3\" et-al-subsequent-use-first=\"1\" disambiguate-add-year-suffix=\"true\" disambiguate-add-names=\"true\" disambiguate-add-givenname=\"true\" collapse=\"year\">\n      <sort>\n         <key macro=\"author\"/>\n         <key macro=\"issued-year\"/>\n      </sort>\n      <layout prefix=\"(\" suffix=\")\" delimiter=\"; \">\n         <group delimiter=\", \">\n            <text macro=\"author-short\"/>\n            <text macro=\"issued-year\"/>\n            <text macro=\"citation-locator\"/>\n         </group>\n      </layout>\n   </citation>\n   <bibliography hanging-indent=\"false\" et-al-min=\"8\" et-al-use-first=\"7\" entry-spacing=\"0\" line-spacing=\"2\">\n      <sort>\n         <key macro=\"author\"/>\n         <key macro=\"issued-year\" sort=\"ascending\"/>\n      </sort>\n      <layout>\n         <group suffix=\".\">\n            <text macro=\"author\" suffix=\".\"/>\n            <text macro=\"issued\" suffix=\" \"/>\n            <group delimiter=\". \">\n               <text macro=\"title\"/>\n               <group>\n                  <text macro=\"container-contributors\"/>\n                  <text macro=\"secondary-contributors\"/>\n                  <group delimiter=\", \">\n                     <text variable=\"container-title\" font-style=\"italic\"/>\n                     <text variable=\"collection-title\"/>\n                  </group>\n               </group>\n            </group>\n            <text macro=\"locators\"/>\n            <group delimiter=\", \" prefix=\". \">\n               <text macro=\"event\"/>\n               <text macro=\"publisher\"/>\n            </group>\n         </group>\n         <text macro=\"access\" prefix=\". \"/>\n      </layout>\n   </bibliography>\n</style>','3462ab776b0b696674d7d608b1d22db4c75d19e2'),('http://www.zotero.org/styles/apsa','American Political Science Association (dev)','apsa.csl','','The American Political Science Association style.','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<style xmlns=\"http://purl.org/net/xbiblio/csl\" class=\"in-text\" version=\"1.0\" demote-non-dropping-particle=\"sort-only\">\n   <info>\n      <title>American Political Science Association (dev)</title>\n      <id>http://www.zotero.org/styles/apsa</id>\n      <link href=\"http://www.zotero.org/styles/apsa\" rel=\"self\"/>\n      <author>\n         <name>Julian Onions</name>\n         <email>julian.onions@gmail.com</email>\n      </author>\n      <contributor>\n         <name>Sebastian Karcher</name>\n      </contributor>\n      <category citation-format=\"author-date\"/>\n      <category field=\"political_science\"/>\n      <updated>2010-07-26T02:21:30+00:00</updated>\n      <summary>The American Political Science Association style.</summary>\n      <link href=\"http://www.ipsonet.org/data/files/APSAStyleManual2006.pdf\" rel=\"documentation\"/>\n      <rights>This work is licensed under a Creative Commons Attribution-Share Alike 3.0 License: http://creativecommons.org/licenses/by-sa/3.0/</rights>\n   </info>\n   <macro name=\"editor\">\n      <names variable=\"editor\" delimiter=\", \">\n         <label form=\"short\" text-case=\"lowercase\" suffix=\". \" strip-periods=\"true\"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"author\">\n      <names variable=\"author\">\n         <name name-as-sort-order=\"first\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"short\" prefix=\", \" suffix=\".\" text-case=\"lowercase\" strip-periods=\"true\"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <text macro=\"title\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"author-short\">\n      <names variable=\"author\">\n         <name form=\"short\" and=\"text\" delimiter=\", \" initialize-with=\". \" sort-separator=\", \"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n            <text macro=\"title\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"access\">\n      <choose>\n         <if type=\"legal_case\" match=\"none\">\n            <group delimiter=\" \">\n               <text variable=\"URL\"/>\n               <group prefix=\"(\" suffix=\")\">\n                  <text term=\"accessed\" text-case=\"capitalize-first\" suffix=\" \"/>\n                  <date variable=\"accessed\">\n                     <date-part name=\"month\" suffix=\" \"/>\n                     <date-part name=\"day\" suffix=\", \"/>\n                     <date-part name=\"year\"/>\n                  </date>\n               </group>\n            </group>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"title\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\"/>\n         </if>\n         <else>\n            <text variable=\"title\" quotes=\"true\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"legal_case\">\n      <group prefix=\" \" delimiter=\" \">\n         <text variable=\"volume\"/>\n         <text variable=\"container-title\"/>\n         <text variable=\"page\"/>\n      </group>\n      <text variable=\"authority\" prefix=\" (\" suffix=\")\"/>\n   </macro>\n   <macro name=\"publisher\">\n      <choose>\n         <if type=\"thesis\" match=\"none\">\n            <group delimiter=\": \">\n               <text variable=\"publisher-place\"/>\n               <text variable=\"publisher\"/>\n            </group>\n            <text variable=\"genre\" prefix=\". \"/>\n         </if>\n         <else>\n            <group delimiter=\". \">\n               <text variable=\"genre\"/>\n               <text variable=\"publisher\"/>\n            </group>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"year-date\">\n      <choose>\n         <if variable=\"issued\">\n            <date variable=\"issued\">\n               <date-part name=\"year\"/>\n            </date>\n         </if>\n         <else>\n            <text term=\"no date\" form=\"short\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"edition\">\n      <choose>\n         <if is-numeric=\"edition\">\n            <group delimiter=\" \">\n               <number variable=\"edition\" form=\"ordinal\"/>\n               <text term=\"edition\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n            </group>\n         </if>\n         <else>\n            <text variable=\"edition\" suffix=\".\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"locator\">\n      <choose>\n         <if locator=\"page\">\n            <text variable=\"locator\"/>\n         </if>\n         <else>\n            <group delimiter=\" \">\n               <label variable=\"locator\" form=\"short\"/>\n               <text variable=\"locator\"/>\n            </group>\n         </else>\n      </choose>\n   </macro>\n   <citation et-al-min=\"4\" et-al-use-first=\"1\" et-al-subsequent-min=\"6\" et-al-subsequent-use-first=\"1\" disambiguate-add-year-suffix=\"true\" disambiguate-add-names=\"true\" disambiguate-add-givenname=\"true\" collapse=\"year\">\n      <sort>\n         <key macro=\"author-short\"/>\n         <key macro=\"year-date\"/>\n      </sort>\n      <layout prefix=\"(\" suffix=\")\" delimiter=\"; \">\n         <group delimiter=\", \">\n            <group delimiter=\" \">\n               <text macro=\"author-short\"/>\n               <text macro=\"year-date\"/>\n            </group>\n            <text macro=\"locator\"/>\n         </group>\n      </layout>\n   </citation>\n   <bibliography hanging-indent=\"true\" et-al-min=\"4\" et-al-use-first=\"1\" subsequent-author-substitute=\"———\">\n      <sort>\n         <key macro=\"author\"/>\n         <key variable=\"title\"/>\n      </sort>\n      <layout suffix=\".\">\n         <text macro=\"author\" suffix=\".\"/>\n         <date variable=\"issued\" prefix=\" \" suffix=\".\">\n            <date-part name=\"year\"/>\n         </date>\n         <choose>\n            <if type=\"bill book graphic legal_case motion_picture report song manuscript thesis\" match=\"any\">\n               <text macro=\"legal_case\"/>\n               <group prefix=\" \" delimiter=\" \">\n                  <text macro=\"title\" suffix=\".\"/>\n                  <text macro=\"edition\"/>\n                  <text macro=\"editor\" suffix=\".\"/>\n               </group>\n               <text prefix=\" \" suffix=\".\" macro=\"publisher\"/>\n            </if>\n            <else-if type=\"chapter paper-conference\" match=\"any\">\n               <text macro=\"title\" prefix=\" \" suffix=\".\"/>\n               <group prefix=\" \" delimiter=\" \">\n                  <text term=\"in\" text-case=\"capitalize-first\"/>\n                  <text variable=\"container-title\" font-style=\"italic\" suffix=\",\"/>\n                  <text variable=\"collection-title\" suffix=\",\"/>\n                  <text macro=\"editor\" suffix=\".\"/>\n                  <group suffix=\".\">\n                     <text macro=\"publisher\"/>\n                     <group prefix=\", \">\n                        <text variable=\"page\" prefix=\"p. \"/>\n                     </group>\n                  </group>\n               </group>\n            </else-if>\n            <else>\n               <group prefix=\" \" delimiter=\" \" suffix=\".\">\n                  <text macro=\"title\"/>\n                  <text macro=\"editor\"/>\n               </group>\n               <group prefix=\" \" suffix=\".\">\n                  <text variable=\"container-title\" font-style=\"italic\"/>\n                  <group prefix=\" \">\n                     <text variable=\"volume\"/>\n                     <text variable=\"issue\" prefix=\"(\" suffix=\")\"/>\n                  </group>\n                  <text variable=\"page\" prefix=\": \"/>\n               </group>\n            </else>\n         </choose>\n         <text prefix=\" \" macro=\"access\" suffix=\".\"/>\n      </layout>\n   </bibliography>\n</style>','c46f11355d34f1685637b794a74a89393371d78a'),('http://www.zotero.org/styles/asa','American Sociological Association','asa.csl','','The ASA style.','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<style xmlns=\"http://purl.org/net/xbiblio/csl\" class=\"in-text\" version=\"1.0\" demote-non-dropping-particle=\"sort-only\">\n   <info>\n      <title>American Sociological Association</title>\n      <id>http://www.zotero.org/styles/asa</id>\n      <link href=\"http://www.zotero.org/styles/asa\" rel=\"self\"/>\n      <author>\n         <name>Julian Onions</name>\n         <email>julian.onions@gmail.com</email>\n      </author>\n      <category citation-format=\"author-date\"/>\n      <category field=\"sociology\"/>\n      <updated>2010-07-26T02:21:30+00:00</updated>\n      <summary>The ASA style.</summary>\n      <link href=\"http://www.asanet.org/Quick%20Style%20Guide.pdf\" rel=\"documentation\"/>\n      <rights>This work is licensed under a Creative Commons Attribution-Share Alike 3.0 License: http://creativecommons.org/licenses/by-sa/3.0/</rights>\n   </info>\n   <macro name=\"editor\">\n      <names variable=\"editor\">\n         <label form=\"verb\" text-case=\"lowercase\" suffix=\" \"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"series-editor\">\n      <names variable=\"original-author\">\n         <label form=\"short\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"anon\">\n      <text term=\"anonymous\" form=\"short\" text-case=\"capitalize-first\" strip-periods=\"true\"/>\n   </macro>\n   <macro name=\"author\">\n      <names variable=\"author\">\n         <name and=\"text\" name-as-sort-order=\"first\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"short\" prefix=\", \" suffix=\".\" text-case=\"lowercase\" strip-periods=\"true\"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n            <text macro=\"anon\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"author-short\">\n      <names variable=\"author\">\n         <name form=\"short\" and=\"text\" delimiter=\", \" initialize-with=\". \"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n            <text macro=\"anon\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"access\">\n      <group>\n         <text term=\"retrieved\" text-case=\"capitalize-first\" suffix=\" \"/>\n         <date variable=\"accessed\">\n            <date-part name=\"month\" suffix=\" \"/>\n            <date-part name=\"day\" suffix=\", \"/>\n            <date-part name=\"year\"/>\n         </date>\n         <group prefix=\" (\" suffix=\")\">\n            <text variable=\"URL\"/>\n         </group>\n      </group>\n   </macro>\n   <macro name=\"title\">\n      <choose>\n         <if type=\"thesis\">\n            <text variable=\"title\"/>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\"/>\n         </else-if>\n         <else>\n            <text variable=\"title\" quotes=\"true\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"publisher\">\n      <group delimiter=\": \">\n         <text variable=\"publisher-place\"/>\n         <text variable=\"publisher\"/>\n      </group>\n   </macro>\n   <macro name=\"year-date\">\n      <choose>\n         <if variable=\"issued\">\n            <date variable=\"issued\">\n               <date-part name=\"year\"/>\n            </date>\n         </if>\n         <else>\n            <text term=\"no date\" form=\"short\" strip-periods=\"true\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"day-month\">\n      <date variable=\"issued\">\n         <date-part name=\"month\"/>\n         <date-part name=\"day\" prefix=\" \"/>\n      </date>\n   </macro>\n   <macro name=\"pages\">\n      <label variable=\"page\" form=\"short\" suffix=\". \" text-case=\"capitalize-first\" strip-periods=\"true\"/>\n      <text variable=\"page\"/>\n   </macro>\n   <macro name=\"edition\">\n      <choose>\n         <if is-numeric=\"edition\">\n            <group delimiter=\" \">\n               <number variable=\"edition\" form=\"ordinal\"/>\n               <text term=\"edition\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n            </group>\n         </if>\n         <else>\n            <text variable=\"edition\" suffix=\".\"/>\n         </else>\n      </choose>\n   </macro>\n   <citation et-al-min=\"4\" et-al-use-first=\"1\" et-al-subsequent-min=\"3\" et-al-subsequent-use-first=\"1\" disambiguate-add-year-suffix=\"true\" disambiguate-add-names=\"true\" disambiguate-add-givenname=\"true\" collapse=\"year\">\n      <layout prefix=\"(\" suffix=\")\" delimiter=\"; \">\n         <group delimiter=\":\">\n            <group delimiter=\" \">\n               <text macro=\"author-short\"/>\n               <text macro=\"year-date\"/>\n            </group>\n            <text variable=\"locator\"/>\n         </group>\n      </layout>\n   </citation>\n   <bibliography hanging-indent=\"true\" et-al-min=\"6\" et-al-use-first=\"1\">\n      <sort>\n         <key macro=\"author\"/>\n         <key variable=\"title\"/>\n      </sort>\n      <layout suffix=\".\">\n         <group delimiter=\" \">\n            <text macro=\"author\" suffix=\".\"/>\n            <text macro=\"year-date\" suffix=\".\"/>\n         </group>\n         <choose>\n            <if type=\"article-newspaper article-magazine\" match=\"any\">\n               <group delimiter=\" \">\n                  <text macro=\"title\" prefix=\" \" suffix=\".\"/>\n               </group>\n               <group prefix=\" \" delimiter=\", \">\n                  <text variable=\"container-title\" font-style=\"italic\"/>\n                  <text macro=\"day-month\"/>\n                  <text variable=\"edition\"/>\n                  <text variable=\"page\"/>\n               </group>\n            </if>\n            <else-if type=\"thesis\">\n               <text macro=\"title\" prefix=\" \" suffix=\".\" quotes=\"true\"/>\n               <group prefix=\" \" delimiter=\", \">\n                  <text macro=\"edition\"/>\n                  <text macro=\"editor\" suffix=\".\"/>\n                  <text variable=\"genre\"/>\n                  <text macro=\"publisher\"/>\n               </group>\n            </else-if>\n            <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n               <group delimiter=\" \">\n                  <text macro=\"title\" prefix=\" \" suffix=\".\"/>\n                  <text macro=\"edition\"/>\n                  <text macro=\"editor\" suffix=\".\"/>\n                  <text macro=\"publisher\"/>\n               </group>\n            </else-if>\n            <else-if type=\"chapter paper-conference\" match=\"any\">\n               <group delimiter=\" \">\n                  <text macro=\"title\" prefix=\" \" suffix=\".\"/>\n                  <group delimiter=\", \" suffix=\".\">\n                     <group delimiter=\" \">\n                        <text macro=\"pages\"/>\n                        <text term=\"in\" text-case=\"lowercase\"/>\n                        <text variable=\"container-title\" font-style=\"italic\"/>\n                     </group>\n                     <text variable=\"volume\" prefix=\"vol. \"/>\n                     <text variable=\"collection-title\" font-style=\"italic\"/>\n                     <text macro=\"editor\"/>\n                  </group>\n                  <text macro=\"publisher\"/>\n               </group>\n            </else-if>\n            <else>\n               <group suffix=\".\">\n                  <text macro=\"title\" prefix=\" \"/>\n                  <text macro=\"editor\" prefix=\" \"/>\n               </group>\n               <group prefix=\" \" suffix=\".\" delimiter=\" \">\n                  <text variable=\"container-title\" font-style=\"italic\"/>\n                  <group delimiter=\":\">\n                     <group>\n                        <text variable=\"volume\"/>\n                        <text variable=\"issue\" prefix=\"(\" suffix=\")\"/>\n                     </group>\n                     <text variable=\"page\"/>\n                  </group>\n               </group>\n            </else>\n         </choose>\n         <text prefix=\" \" macro=\"access\" suffix=\".\"/>\n      </layout>\n   </bibliography>\n</style>','6490bd432c44d2b0746efa1c84b0bec4c478fd9b'),('http://www.zotero.org/styles/chicago-author-date','Chicago Manual of Style (Author-Date format)','chicago-author-date.csl','','The author-date variant of the Chicago style','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<style xmlns=\"http://purl.org/net/xbiblio/csl\" class=\"in-text\" version=\"1.0\" demote-non-dropping-particle=\"sort-only\">\n   <info>\n      <title>Chicago Manual of Style (Author-Date format)</title>\n      <id>http://www.zotero.org/styles/chicago-author-date</id>\n      <link href=\"http://www.zotero.org/styles/chicago-author-date\" rel=\"self\"/>\n      <author>\n         <name>Julian Onions</name>\n         <email>julian.onions@gmail.com</email>\n      </author>\n      <category citation-format=\"author-date\"/>\n      <category field=\"generic-base\"/>\n      <updated>2009-12-04T20:22:16+00:00</updated>\n      <summary>The author-date variant of the Chicago style</summary>\n      <link href=\"http://www.chicagomanualofstyle.org/tools_citationguide.html\" rel=\"documentation\"/>\n      <rights>This work is licensed under a Creative Commons Attribution-Share Alike 3.0 License: http://creativecommons.org/licenses/by-sa/3.0/</rights>\n   </info>\n   <macro name=\"secondary-contributors\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"none\">\n            <group delimiter=\". \">\n               <choose>\n                  <if variable=\"author\">\n                     <names variable=\"editor\">\n                        <label form=\"verb-short\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                  </if>\n               </choose>\n               <choose>\n                  <if variable=\"author editor\" match=\"any\">\n                     <names variable=\"translator\">\n                        <label form=\"verb-short\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                  </if>\n               </choose>\n            </group>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"container-contributors\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <group prefix=\", \" delimiter=\", \">\n               <choose>\n                  <if variable=\"author\">\n                     <names variable=\"editor\">\n                        <label form=\"verb-short\" prefix=\" \" text-case=\"lowercase\" suffix=\". \" strip-periods=\"true\"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                     <choose>\n                        <if variable=\"container-author\">\n                           <group>\n                              <names variable=\"container-author\">\n                                 <label form=\"verb-short\" prefix=\" \" text-case=\"lowercase\" suffix=\" \" strip-periods=\"true\"/>\n                                 <name and=\"text\" delimiter=\", \"/>\n                              </names>\n                           </group>\n                        </if>\n                     </choose>\n                  </if>\n               </choose>\n               <choose>\n                  <if variable=\"author editor\" match=\"any\">\n                     <names variable=\"translator\">\n                        <label form=\"verb-short\" prefix=\" \" text-case=\"lowercase\" suffix=\". \" strip-periods=\"true\"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                  </if>\n               </choose>\n            </group>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"anon\">\n      <choose>\n         <if variable=\"author editor translator\" match=\"none\">\n            <text term=\"anonymous\" form=\"short\" text-case=\"capitalize-first\" suffix=\".\" strip-periods=\"true\"/>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"editor\">\n      <names variable=\"editor\">\n         <name name-as-sort-order=\"first\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"short\" prefix=\", \" suffix=\".\" strip-periods=\"true\"/>\n      </names>\n   </macro>\n   <macro name=\"translator\">\n      <names variable=\"translator\">\n         <name name-as-sort-order=\"first\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"verb-short\" prefix=\", \" suffix=\".\" strip-periods=\"true\"/>\n      </names>\n   </macro>\n   <macro name=\"recipient\">\n      <choose>\n         <if type=\"personal_communication\">\n            <choose>\n               <if variable=\"genre\">\n                  <text variable=\"genre\" text-case=\"capitalize-first\"/>\n               </if>\n               <else>\n                  <text term=\"letter\" text-case=\"capitalize-first\"/>\n               </else>\n            </choose>\n         </if>\n      </choose>\n      <names variable=\"recipient\" delimiter=\", \">\n         <label form=\"verb\" prefix=\" \" text-case=\"lowercase\" suffix=\" \"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"contributors\">\n      <names variable=\"author\">\n         <name and=\"text\" name-as-sort-order=\"first\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"verb-short\" prefix=\", \" suffix=\".\" text-case=\"lowercase\" strip-periods=\"true\"/>\n         <substitute>\n            <text macro=\"editor\"/>\n            <text macro=\"translator\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"contributors-short\">\n      <names variable=\"author\">\n         <name form=\"short\" and=\"text\" delimiter=\", \"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n         </substitute>\n      </names>\n      <text macro=\"anon\"/>\n   </macro>\n   <macro name=\"interviewer\">\n      <names variable=\"interviewer\" delimiter=\", \">\n         <label form=\"verb\" prefix=\" \" text-case=\"capitalize-first\" suffix=\" \"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"archive\">\n      <group delimiter=\". \">\n         <text variable=\"archive_location\" text-case=\"capitalize-first\"/>\n         <text variable=\"archive\"/>\n         <text variable=\"archive-place\"/>\n      </group>\n   </macro>\n   <macro name=\"access\">\n      <group delimiter=\". \">\n         <choose>\n            <if type=\"graphic report\" match=\"any\">\n               <text macro=\"archive\"/>\n            </if>\n            <else-if type=\"bill book graphic legal_case motion_picture report song article-journal article-magazine article-newspaper thesis chapter paper-conference\" match=\"none\">\n               <text macro=\"archive\"/>\n            </else-if>\n         </choose>\n         <text variable=\"DOI\" prefix=\"doi:\"/>\n         <choose>\n            <if type=\"legal_case\" match=\"none\">\n               <text variable=\"URL\"/>\n            </if>\n         </choose>\n      </group>\n   </macro>\n   <macro name=\"title\">\n      <choose>\n         <if variable=\"title\" match=\"none\">\n            <choose>\n               <if type=\"personal_communication\" match=\"none\">\n                  <text variable=\"genre\" text-case=\"capitalize-first\"/>\n               </if>\n            </choose>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\"/>\n         </else-if>\n         <else>\n            <text variable=\"title\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"edition\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <choose>\n               <if is-numeric=\"edition\">\n                  <group delimiter=\" \">\n                     <number variable=\"edition\" form=\"ordinal\"/>\n                     <text term=\"edition\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n                  </group>\n               </if>\n               <else>\n                  <text variable=\"edition\" suffix=\".\"/>\n               </else>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"locators\">\n      <choose>\n         <if type=\"article-journal\">\n            <text variable=\"volume\" prefix=\" \"/>\n            <group prefix=\", \">\n               <text term=\"issue\" form=\"short\" suffix=\". \" strip-periods=\"true\"/>\n               <number variable=\"issue\"/>\n            </group>\n         </if>\n         <else-if type=\"legal_case\">\n            <text variable=\"volume\" prefix=\", \"/>\n            <text variable=\"container-title\" prefix=\" \"/>\n            <text variable=\"page\" prefix=\" \"/>\n         </else-if>\n         <else-if type=\"patent\">\n            <group prefix=\". \">\n              <text variable=\"section\" suffix=\" Patent\"/>\n              <text variable=\"volume\" prefix=\" \"/>\n            </group>\n         </else-if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <group prefix=\". \" delimiter=\". \">\n               <group>\n                  <text term=\"volume\" form=\"short\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n                  <number variable=\"volume\" form=\"numeric\"/>\n               </group>\n               <group>\n                  <number variable=\"number-of-volumes\" form=\"numeric\"/>\n                  <text term=\"volume\" form=\"short\" prefix=\" \" suffix=\".\" plural=\"true\" strip-periods=\"true\"/>\n               </group>\n            </group>\n         </else-if>\n         <else-if type=\"chapter paper-conference\" match=\"any\">\n            <choose>\n               <if variable=\"page\" match=\"none\">\n                  <group prefix=\". \">\n                     <text term=\"volume\" form=\"short\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n                     <number variable=\"volume\" form=\"numeric\"/>\n                  </group>\n               </if>\n            </choose>\n         </else-if>\n      </choose>\n   </macro>\n   <macro name=\"locators-chapter\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <choose>\n               <if variable=\"page\">\n                  <group prefix=\", \">\n                     <text variable=\"volume\" suffix=\":\"/>\n                     <text variable=\"page\"/>\n                  </group>\n               </if>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"locators-article\">\n      <choose>\n         <if type=\"article-newspaper\">\n            <group prefix=\", \" delimiter=\", \">\n               <group>\n                  <text variable=\"edition\" suffix=\" \"/>\n                  <text term=\"edition\" prefix=\" \"/>\n               </group>\n               <group>\n                  <text term=\"section\" form=\"short\" suffix=\". \" strip-periods=\"true\"/>\n                  <text variable=\"section\"/>\n               </group>\n            </group>\n         </if>\n         <else-if type=\"article-journal\">\n            <text variable=\"page\" prefix=\": \"/>\n         </else-if>\n      </choose>\n   </macro>\n   <macro name=\"point-locators\">\n      <group>\n         <choose>\n            <if locator=\"page\" match=\"none\">\n               <choose>\n                  <if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n                     <choose>\n                        <if variable=\"volume\">\n                           <group>\n                              <text term=\"volume\" form=\"short\" text-case=\"lowercase\" suffix=\". \" strip-periods=\"true\"/>\n                              <number variable=\"volume\" form=\"numeric\"/>\n                              <label variable=\"locator\" form=\"short\" prefix=\", \" suffix=\" \"/>\n                           </group>\n                        </if>\n                        <else>\n                           <label variable=\"locator\" form=\"short\" suffix=\" \"/>\n                        </else>\n                     </choose>\n                  </if>\n               </choose>\n            </if>\n            <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n               <number variable=\"volume\" form=\"numeric\" suffix=\":\"/>\n            </else-if>\n         </choose>\n         <text variable=\"locator\"/>\n      </group>\n   </macro>\n   <macro name=\"container-prefix\">\n      <text term=\"in\" text-case=\"capitalize-first\"/>\n   </macro>\n   <macro name=\"container-title\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <text macro=\"container-prefix\" suffix=\" \"/>\n         </if>\n      </choose>\n      <choose>\n         <if type=\"legal_case\" match=\"none\">\n            <text variable=\"container-title\" font-style=\"italic\"/>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"publisher\">\n      <group delimiter=\": \">\n         <text variable=\"publisher-place\"/>\n         <text variable=\"publisher\"/>\n      </group>\n   </macro>\n   <macro name=\"date\">\n      <choose>\n         <if variable=\"issued\">\n            <date variable=\"issued\">\n               <date-part name=\"year\"/>\n            </date>\n         </if>\n         <else>\n            <text term=\"no date\" form=\"short\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"day-month\">\n      <date variable=\"issued\">\n         <date-part name=\"month\"/>\n         <date-part name=\"day\" prefix=\" \"/>\n      </date>\n   </macro>\n   <macro name=\"collection-title\">\n      <text variable=\"collection-title\"/>\n      <text variable=\"collection-number\" prefix=\" \"/>\n   </macro>\n   <macro name=\"event\">\n      <group>\n         <text term=\"presented at\" suffix=\" \"/>\n         <text variable=\"event\"/>\n      </group>\n   </macro>\n   <macro name=\"description\">\n      <choose>\n         <if type=\"interview\">\n            <group delimiter=\". \">\n               <text macro=\"interviewer\"/>\n               <text variable=\"medium\" text-case=\"capitalize-first\"/>\n            </group>\n         </if>\n         <else>\n            <text variable=\"medium\" text-case=\"capitalize-first\" prefix=\". \"/>\n         </else>\n      </choose>\n      <choose>\n         <if variable=\"title\" match=\"none\"/>\n         <else-if type=\"thesis\"/>\n         <else>\n            <text variable=\"genre\" text-case=\"capitalize-first\" prefix=\". \"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"issue\">\n      <choose>\n         <if type=\"article-journal\">\n            <text macro=\"day-month\" prefix=\" (\" suffix=\")\"/>\n         </if>\n         <else-if type=\"legal_case\">\n            <text variable=\"authority\" prefix=\". \"/>\n         </else-if>\n         <else-if type=\"speech\">\n            <group prefix=\" \" delimiter=\", \">\n               <text macro=\"event\"/>\n               <text macro=\"day-month\"/>\n               <text variable=\"event-place\"/>\n            </group>\n         </else-if>\n         <else-if type=\"article-newspaper article-magazine\" match=\"any\">\n            <text macro=\"day-month\" prefix=\", \"/>\n         </else-if>\n         <else>\n            <group prefix=\". \" delimiter=\", \">\n               <choose>\n                  <if type=\"thesis\">\n                     <text variable=\"genre\" text-case=\"capitalize-first\"/>\n                  </if>\n               </choose>\n               <text macro=\"publisher\"/>\n               <text macro=\"day-month\"/>\n            </group>\n         </else>\n      </choose>\n   </macro>\n   <citation et-al-min=\"4\" et-al-use-first=\"1\" et-al-subsequent-min=\"4\" et-al-subsequent-use-first=\"1\" disambiguate-add-year-suffix=\"true\" disambiguate-add-names=\"true\" disambiguate-add-givenname=\"true\">\n      <layout prefix=\"(\" suffix=\")\" delimiter=\"; \">\n         <group delimiter=\", \">\n            <group delimiter=\" \">\n               <text macro=\"contributors-short\"/>\n               <text macro=\"date\"/>\n            </group>\n            <text macro=\"point-locators\"/>\n         </group>\n      </layout>\n   </citation>\n   <bibliography hanging-indent=\"false\" et-al-min=\"11\" et-al-use-first=\"7\" subsequent-author-substitute=\"———\" entry-spacing=\"0\">\n      <sort>\n         <key macro=\"contributors\"/>\n         <key macro=\"anon\"/>\n         <key macro=\"recipient\"/>\n         <key variable=\"issued\"/>\n      </sort>\n      <layout suffix=\".\">\n        <choose>\n          <if type=\"patent\">\n            <text macro=\"contributors\" suffix=\". \"/>\n            <text macro=\"anon\"/>\n            <text macro=\"title\"/>\n            <text macro=\"description\"/>\n            <text macro=\"secondary-contributors\" prefix=\". \"/>\n            <text macro=\"container-title\" prefix=\". \"/>\n            <text macro=\"container-contributors\"/>\n            <text macro=\"locators\"/>\n            <text macro=\"issue\"/>\n            <text macro=\"date\" prefix=\", filed \" suffix=\".\"/>\n          </if>\n          <else>\n            <text macro=\"contributors\" suffix=\". \"/>\n            <text macro=\"anon\"/>\n            <text macro=\"recipient\"/>\n            <text macro=\"date\" suffix=\". \"/>\n            <text macro=\"title\"/>\n            <text macro=\"description\"/>\n            <text macro=\"secondary-contributors\" prefix=\". \"/>\n            <text macro=\"container-title\" prefix=\". \"/>\n            <text macro=\"container-contributors\"/>\n            <text macro=\"locators-chapter\"/>\n            <text macro=\"edition\" prefix=\". \"/>\n            <text macro=\"locators\"/>\n            <text macro=\"collection-title\" prefix=\". \"/>\n            <text macro=\"issue\"/>\n            <text macro=\"locators-article\"/>\n            <text macro=\"access\" prefix=\". \"/>\n          </else>\n        </choose>\n      </layout>\n   </bibliography>\n</style>','fa578ad0f377563b2a9b91ae18b60d3f9d7a52f7'),('http://www.zotero.org/styles/chicago-fullnote-bibliography','Chicago Manual of Style (Full Note with Bibliography)','chicago-fullnote-bibliography.csl','','Chicago format with full notes and bibliography','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<style xmlns=\"http://purl.org/net/xbiblio/csl\" class=\"note\" version=\"1.0\" demote-non-dropping-particle=\"sort-only\">\n   <info>\n      <title>Chicago Manual of Style (Full Note with Bibliography)</title>\n      <id>http://www.zotero.org/styles/chicago-fullnote-bibliography</id>\n      <link href=\"http://www.zotero.org/styles/chicago-fullnote-bibliography\" rel=\"self\"/>\n      <link href=\"http://www.chicagomanualofstyle.org/tools_citationguide.html\" rel=\"documentation\"/>\n      <author>\n         <name>Julian Onions</name>\n         <email>julian.onions@gmail.com</email>\n      </author>\n      <contributor>\n         <name>Simon Kornblith</name>\n         <email>simon@simonster.com</email>\n      </contributor>\n      <contributor>\n         <name>Elena Razlogova</name>\n         <email>elena.razlogova@gmail.com</email>\n      </contributor>\n      <summary>Chicago format with full notes and bibliography</summary>\n      <category field=\"generic-base\"/>\n      <category citation-format=\"numeric\"/>\n      <updated>2009-12-04T20:22:16+00:00</updated>\n      <rights>This work is licensed under a Creative Commons Attribution-Share Alike 3.0 License: http://creativecommons.org/licenses/by-sa/3.0/</rights>\n   </info>\n   <macro name=\"editor-translator\">\n      <group delimiter=\", \">\n         <choose>\n            <if variable=\"author\">\n               <names variable=\"editor\" delimiter=\", \">\n                  <label form=\"verb-short\" text-case=\"lowercase\" suffix=\". \" strip-periods=\"true\"/>\n                  <name and=\"text\" delimiter=\", \"/>\n               </names>\n               <choose>\n                  <if variable=\"container-author\">\n                     <group>\n                        <names variable=\"container-author\">\n                           <label form=\"verb-short\" prefix=\" \" text-case=\"lowercase\" suffix=\" \" strip-periods=\"true\"/>\n                           <name and=\"text\" delimiter=\", \"/>\n                        </names>\n                     </group>\n                  </if>\n               </choose>\n            </if>\n         </choose>\n         <choose>\n            <if variable=\"author editor\" match=\"any\">\n               <names variable=\"translator\" delimiter=\", \">\n                  <label form=\"verb-short\" text-case=\"lowercase\" suffix=\". \" strip-periods=\"true\"/>\n                  <name and=\"text\" delimiter=\", \"/>\n               </names>\n            </if>\n         </choose>\n      </group>\n   </macro>\n   <macro name=\"secondary-contributors-note\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"none\">\n            <text macro=\"editor-translator\"/>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"container-contributors-note\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <text macro=\"editor-translator\"/>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"secondary-contributors\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"none\">\n            <group delimiter=\". \">\n               <choose>\n                  <if variable=\"author\">\n                     <names variable=\"editor\" delimiter=\". \">\n                        <label form=\"verb\" text-case=\"capitalize-first\" suffix=\" \"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                  </if>\n               </choose>\n               <choose>\n                  <if variable=\"author editor\" match=\"any\">\n                     <names variable=\"translator\" delimiter=\". \">\n                        <label form=\"verb\" text-case=\"capitalize-first\" suffix=\" \"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                  </if>\n               </choose>\n            </group>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"container-contributors\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <group delimiter=\", \">\n               <choose>\n                  <if variable=\"author\">\n                     <names variable=\"editor\" delimiter=\", \">\n                        <label form=\"verb\" text-case=\"lowercase\" suffix=\" \"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                     <choose>\n                        <if variable=\"container-author\">\n                           <group>\n                              <names variable=\"container-author\">\n                                 <label form=\"verb-short\" prefix=\" \" text-case=\"lowercase\" suffix=\" \" strip-periods=\"true\"/>\n                                 <name and=\"text\" delimiter=\", \"/>\n                              </names>\n                           </group>\n                        </if>\n                     </choose>\n                  </if>\n               </choose>\n               <choose>\n                  <if variable=\"author editor\" match=\"any\">\n                     <names variable=\"translator\" delimiter=\", \">\n                        <label form=\"verb\" text-case=\"lowercase\" suffix=\" \"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                  </if>\n               </choose>\n            </group>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"editor-note\">\n      <names variable=\"editor\">\n         <name and=\"text\" sort-separator=\", \" delimiter=\", \"/>\n         <label form=\"short\" prefix=\", \" suffix=\".\" strip-periods=\"true\"/>\n      </names>\n   </macro>\n   <macro name=\"translator-note\">\n      <names variable=\"translator\">\n         <name and=\"text\" sort-separator=\", \" delimiter=\", \"/>\n         <label form=\"verb-short\" prefix=\", \" suffix=\".\" strip-periods=\"true\"/>\n      </names>\n   </macro>\n   <macro name=\"recipient-note\">\n      <names variable=\"recipient\" delimiter=\", \">\n         <label form=\"verb\" prefix=\" \" text-case=\"lowercase\" suffix=\" \"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"contributors-note\">\n      <names variable=\"author\">\n         <name and=\"text\" sort-separator=\", \" delimiter=\", \"/>\n         <substitute>\n            <text macro=\"editor-note\"/>\n            <text macro=\"translator-note\"/>\n         </substitute>\n      </names>\n      <text macro=\"recipient-note\"/>\n   </macro>\n   <macro name=\"editor\">\n      <names variable=\"editor\">\n         <name name-as-sort-order=\"first\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"short\" prefix=\", \" suffix=\".\" strip-periods=\"true\"/>\n      </names>\n   </macro>\n   <macro name=\"translator\">\n      <names variable=\"translator\">\n         <name name-as-sort-order=\"first\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"verb-short\" prefix=\", \" suffix=\".\" strip-periods=\"true\"/>\n      </names>\n   </macro>\n   <macro name=\"recipient\">\n      <choose>\n         <if type=\"personal_communication\">\n            <choose>\n               <if variable=\"genre\">\n                  <text variable=\"genre\" text-case=\"capitalize-first\"/>\n               </if>\n               <else>\n                  <text term=\"letter\" text-case=\"capitalize-first\"/>\n               </else>\n            </choose>\n         </if>\n      </choose>\n      <text macro=\"recipient-note\" prefix=\" \"/>\n   </macro>\n   <macro name=\"contributors\">\n      <names variable=\"author\">\n         <name name-as-sort-order=\"first\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <substitute>\n            <text macro=\"editor\"/>\n            <text macro=\"translator\"/>\n         </substitute>\n      </names>\n      <text macro=\"recipient\" prefix=\". \"/>\n   </macro>\n   <macro name=\"recipient-short\">\n      <names variable=\"recipient\">\n         <label form=\"verb\" prefix=\" \" text-case=\"lowercase\" suffix=\" \"/>\n         <name form=\"short\" and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"contributors-short\">\n      <names variable=\"author\">\n         <name form=\"short\" and=\"text\" delimiter=\", \"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n         </substitute>\n      </names>\n      <text macro=\"recipient-short\"/>\n   </macro>\n   <macro name=\"contributors-sort\">\n      <names variable=\"author\">\n         <name name-as-sort-order=\"all\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"verb-short\" prefix=\", \" suffix=\".\" strip-periods=\"true\"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"interviewer-note\">\n      <names variable=\"interviewer\" delimiter=\", \">\n         <label form=\"verb\" prefix=\" \" text-case=\"lowercase\" suffix=\" \"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"interviewer\">\n      <names variable=\"interviewer\" delimiter=\", \">\n         <label form=\"verb\" prefix=\" \" text-case=\"capitalize-first\" suffix=\" \"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"title-note\">\n      <choose>\n         <if variable=\"title\" match=\"none\">\n            <text variable=\"genre\"/>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\"/>\n         </else-if>\n         <else>\n            <text variable=\"title\" quotes=\"true\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"title\">\n      <choose>\n         <if variable=\"title\" match=\"none\">\n            <choose>\n               <if type=\"personal_communication\" match=\"none\">\n                  <text variable=\"genre\" text-case=\"capitalize-first\"/>\n               </if>\n            </choose>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\"/>\n         </else-if>\n         <else>\n            <text variable=\"title\" quotes=\"true\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"title-short\">\n      <choose>\n         <if variable=\"title\" match=\"none\">\n            <choose>\n               <if type=\"interview\">\n                  <text term=\"interview\" text-case=\"lowercase\"/>\n               </if>\n               <else-if type=\"manuscript speech\" match=\"any\">\n                  <text variable=\"genre\" form=\"short\"/>\n               </else-if>\n               <else-if type=\"personal_communication\">\n                  <text macro=\"issued\"/>\n               </else-if>\n            </choose>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" form=\"short\" font-style=\"italic\"/>\n         </else-if>\n         <else>\n            <text variable=\"title\" form=\"short\" quotes=\"true\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"description-note\">\n      <group delimiter=\", \">\n         <text macro=\"interviewer-note\"/>\n         <text variable=\"medium\"/>\n         <choose>\n            <if variable=\"title\" match=\"none\"/>\n            <else-if type=\"thesis speech\" match=\"any\"/>\n            <else>\n               <text variable=\"genre\"/>\n            </else>\n         </choose>\n      </group>\n   </macro>\n   <macro name=\"description\">\n      <group delimiter=\", \">\n         <group delimiter=\". \">\n            <text macro=\"interviewer\"/>\n            <text variable=\"medium\" text-case=\"capitalize-first\"/>\n         </group>\n         <choose>\n            <if variable=\"title\" match=\"none\"/>\n            <else-if type=\"thesis speech\" match=\"any\"/>\n            <else>\n               <text variable=\"genre\" text-case=\"capitalize-first\"/>\n            </else>\n         </choose>\n      </group>\n   </macro>\n   <macro name=\"container-title-note\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <text term=\"in\" text-case=\"lowercase\" suffix=\" \"/>\n         </if>\n      </choose>\n      <choose>\n         <if type=\"legal_case\" match=\"none\">\n            <text variable=\"container-title\" font-style=\"italic\"/>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"container-title\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <text term=\"in\" text-case=\"capitalize-first\" suffix=\" \"/>\n         </if>\n      </choose>\n      <choose>\n         <if type=\"legal_case\" match=\"none\">\n            <text variable=\"container-title\" font-style=\"italic\"/>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"collection-title\">\n      <text variable=\"collection-title\"/>\n      <text variable=\"collection-number\" prefix=\" \"/>\n   </macro>\n   <macro name=\"edition-note\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <choose>\n               <if is-numeric=\"edition\">\n                  <group delimiter=\" \">\n                     <number variable=\"edition\" form=\"ordinal\"/>\n                     <text term=\"edition\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n                  </group>\n               </if>\n               <else>\n                  <text variable=\"edition\" suffix=\".\"/>\n               </else>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"edition\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <choose>\n               <if is-numeric=\"edition\">\n                  <group delimiter=\" \">\n                     <number variable=\"edition\" form=\"ordinal\"/>\n                     <text term=\"edition\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n                  </group>\n               </if>\n               <else>\n                  <text variable=\"edition\" text-case=\"capitalize-first\" suffix=\".\"/>\n               </else>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"locators-note\">\n      <choose>\n         <if type=\"article-journal\">\n            <text variable=\"volume\" prefix=\" \"/>\n            <group prefix=\", \">\n               <text term=\"issue\" form=\"short\" suffix=\". \" strip-periods=\"true\"/>\n               <number variable=\"issue\"/>\n            </group>\n         </if>\n         <else-if type=\"legal_case\">\n            <text variable=\"volume\" prefix=\", \"/>\n            <text variable=\"container-title\" prefix=\" \"/>\n            <text variable=\"page\" prefix=\" \"/>\n            <text variable=\"locator\" prefix=\", \"/>\n         </else-if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <group prefix=\", \" delimiter=\", \">\n               <group>\n                  <text term=\"volume\" form=\"short\" suffix=\". \" strip-periods=\"true\"/>\n                  <number variable=\"volume\" form=\"numeric\"/>\n               </group>\n               <choose>\n                  <if variable=\"locator\" match=\"none\">\n                     <group>\n                        <number variable=\"number-of-volumes\" form=\"numeric\"/>\n                        <text term=\"volume\" form=\"short\" prefix=\" \" suffix=\".\" plural=\"true\" strip-periods=\"true\"/>\n                     </group>\n                  </if>\n               </choose>\n               <text macro=\"edition-note\"/>\n            </group>\n         </else-if>\n      </choose>\n   </macro>\n   <macro name=\"locators\">\n      <choose>\n         <if type=\"article-journal\">\n            <text variable=\"volume\" prefix=\" \"/>\n            <group prefix=\", \">\n               <text term=\"issue\" form=\"short\" suffix=\". \" strip-periods=\"true\"/>\n               <number variable=\"issue\"/>\n            </group>\n         </if>\n         <else-if type=\"legal_case\">\n            <text variable=\"volume\" prefix=\", \"/>\n            <text variable=\"container-title\" prefix=\" \"/>\n            <text variable=\"page\" prefix=\" \"/>\n         </else-if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <group prefix=\". \" delimiter=\". \">\n               <group>\n                  <text term=\"volume\" form=\"short\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n                  <number variable=\"volume\" form=\"numeric\"/>\n               </group>\n               <group>\n                  <number variable=\"number-of-volumes\" form=\"numeric\"/>\n                  <text term=\"volume\" form=\"short\" prefix=\" \" suffix=\".\" plural=\"true\" strip-periods=\"true\"/>\n               </group>\n               <text macro=\"edition\"/>\n            </group>\n         </else-if>\n         <else-if type=\"chapter paper-conference\" match=\"any\">\n            <group prefix=\". \" delimiter=\". \">\n               <choose>\n                  <if variable=\"page\" match=\"none\">\n                     <group>\n                        <text term=\"volume\" form=\"short\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n                        <number variable=\"volume\" form=\"numeric\"/>\n                     </group>\n                  </if>\n               </choose>\n               <text macro=\"edition\"/>\n            </group>\n         </else-if>\n      </choose>\n   </macro>\n   <macro name=\"locators-newspaper\">\n      <choose>\n         <if type=\"article-newspaper\">\n            <group delimiter=\", \">\n               <group>\n                  <text variable=\"edition\" suffix=\" \"/>\n                  <text term=\"edition\" prefix=\" \"/>\n               </group>\n               <group>\n                  <text term=\"section\" form=\"short\" suffix=\". \" strip-periods=\"true\"/>\n                  <text variable=\"section\"/>\n               </group>\n            </group>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"event\">\n      <group>\n         <text term=\"presented at\" suffix=\" \"/>\n         <text variable=\"event\"/>\n      </group>\n   </macro>\n   <macro name=\"publisher\">\n      <group delimiter=\": \">\n         <text variable=\"publisher-place\"/>\n         <text variable=\"publisher\"/>\n      </group>\n   </macro>\n   <macro name=\"issued\">\n      <choose>\n         <if variable=\"issued\">\n            <choose>\n               <if type=\"graphic report\" match=\"any\">\n                  <date variable=\"issued\">\n                     <date-part name=\"month\" suffix=\" \"/>\n                     <date-part name=\"day\" suffix=\", \"/>\n                     <date-part name=\"year\"/>\n                  </date>\n               </if>\n               <else-if type=\"legal_case\">\n                  <text variable=\"authority\" suffix=\" \"/>\n                  <date variable=\"issued\">\n                     <date-part name=\"year\"/>\n                  </date>\n               </else-if>\n               <else-if type=\"bill book graphic legal_case motion_picture report song thesis chapter paper-conference\" match=\"any\">\n                  <date variable=\"issued\">\n                     <date-part name=\"year\"/>\n                  </date>\n               </else-if>\n               <else>\n                  <date variable=\"issued\">\n                     <date-part name=\"month\" suffix=\" \"/>\n                     <date-part name=\"day\" suffix=\", \"/>\n                     <date-part name=\"year\"/>\n                  </date>\n               </else>\n            </choose>\n         </if>\n         <else>\n            <text term=\"no date\" form=\"short\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"point-locators-subsequent\">\n      <group>\n         <choose>\n            <if locator=\"page\" match=\"none\">\n               <choose>\n                  <if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n                     <choose>\n                        <if variable=\"volume\">\n                           <group>\n                              <text term=\"volume\" form=\"short\" text-case=\"lowercase\" suffix=\". \" strip-periods=\"true\"/>\n                              <number variable=\"volume\" form=\"numeric\"/>\n                              <label variable=\"locator\" form=\"short\" prefix=\", \" suffix=\" \"/>\n                           </group>\n                        </if>\n                        <else>\n                           <label variable=\"locator\" form=\"short\" suffix=\" \"/>\n                        </else>\n                     </choose>\n                  </if>\n               </choose>\n            </if>\n            <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n               <number variable=\"volume\" form=\"numeric\" suffix=\":\"/>\n            </else-if>\n         </choose>\n         <text variable=\"locator\"/>\n      </group>\n   </macro>\n   <macro name=\"point-locators\">\n      <choose>\n         <if variable=\"locator\" match=\"none\">\n            <text macro=\"pages\"/>\n         </if>\n         <else-if type=\"article-journal\">\n            <text variable=\"locator\" prefix=\": \"/>\n         </else-if>\n         <else-if type=\"legal_case\"/>\n         <else>\n            <group prefix=\", \">\n               <choose>\n                  <if locator=\"page\" match=\"none\">\n                     <label variable=\"locator\" form=\"short\" suffix=\" \"/>\n                  </if>\n               </choose>\n               <text variable=\"locator\"/>\n            </group>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"pages\">\n      <choose>\n         <if type=\"article-journal\">\n            <text variable=\"page\" prefix=\": \"/>\n         </if>\n         <else-if type=\"chapter paper-conference\" match=\"any\">\n            <text variable=\"page\" prefix=\", \"/>\n         </else-if>\n      </choose>\n   </macro>\n   <macro name=\"locators-chapter\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <choose>\n               <if variable=\"page\">\n                  <text variable=\"volume\" suffix=\":\"/>\n                  <text variable=\"page\"/>\n               </if>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"locators-journal\">\n      <choose>\n         <if type=\"article-journal\">\n            <text variable=\"page\" prefix=\": \"/>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"archive-note\">\n      <group delimiter=\", \">\n         <text variable=\"archive_location\"/>\n         <text variable=\"archive\"/>\n         <text variable=\"archive-place\"/>\n      </group>\n   </macro>\n   <macro name=\"archive\">\n      <group delimiter=\". \">\n         <text variable=\"archive_location\" text-case=\"capitalize-first\"/>\n         <text variable=\"archive\"/>\n         <text variable=\"archive-place\"/>\n      </group>\n   </macro>\n   <macro name=\"issue-note\">\n      <choose>\n         <if type=\"article-journal legal_case\" match=\"any\">\n            <text macro=\"issued\" prefix=\" (\" suffix=\")\"/>\n         </if>\n         <else-if variable=\"publisher-place publisher\" match=\"any\">\n            <group prefix=\" (\" suffix=\")\" delimiter=\", \">\n               <group delimiter=\" \">\n                  <choose>\n                     <if variable=\"title\" match=\"none\"/>\n                     <else-if type=\"thesis speech\" match=\"any\">\n                        <text variable=\"genre\"/>\n                     </else-if>\n                  </choose>\n                  <text macro=\"event\"/>\n               </group>\n               <text macro=\"publisher\"/>\n               <text macro=\"issued\"/>\n            </group>\n         </else-if>\n         <else>\n            <text macro=\"issued\" prefix=\", \"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"issue\">\n      <choose>\n         <if type=\"article-journal legal_case\" match=\"any\">\n            <text macro=\"issued\" prefix=\" (\" suffix=\")\"/>\n         </if>\n         <else-if type=\"speech\">\n            <choose>\n               <if variable=\"title\" match=\"none\"/>\n               <else>\n                  <text variable=\"genre\" text-case=\"capitalize-first\" prefix=\". \"/>\n               </else>\n            </choose>\n            <text macro=\"event\" prefix=\" \"/>\n            <text variable=\"event-place\" prefix=\", \"/>\n            <text macro=\"issued\" prefix=\", \"/>\n         </else-if>\n         <else-if variable=\"publisher-place publisher\" match=\"any\">\n            <group prefix=\". \" delimiter=\", \">\n               <choose>\n                  <if type=\"thesis\">\n                     <text variable=\"genre\" text-case=\"capitalize-first\"/>\n                  </if>\n               </choose>\n               <text macro=\"publisher\"/>\n               <text macro=\"issued\"/>\n            </group>\n         </else-if>\n         <else>\n            <text macro=\"issued\" prefix=\", \"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"access-note\">\n      <group delimiter=\", \">\n         <choose>\n            <if type=\"graphic report\" match=\"any\">\n               <text macro=\"archive-note\"/>\n            </if>\n            <else-if type=\"bill book graphic legal_case motion_picture report song article-journal article-magazine article-newspaper thesis chapter paper-conference\" match=\"none\">\n               <text macro=\"archive-note\"/>\n            </else-if>\n         </choose>\n         <choose>\n            <if type=\"legal_case\" match=\"none\">\n               <text variable=\"URL\"/>\n            </if>\n         </choose>\n      </group>\n   </macro>\n   <macro name=\"access\">\n      <group delimiter=\". \">\n         <choose>\n            <if type=\"graphic report\" match=\"any\">\n               <text macro=\"archive\"/>\n            </if>\n            <else-if type=\"bill book graphic legal_case motion_picture report song article-journal article-magazine article-newspaper thesis chapter paper-conference\" match=\"none\">\n               <text macro=\"archive\"/>\n            </else-if>\n         </choose>\n         <choose>\n            <if type=\"legal_case\" match=\"none\">\n               <text variable=\"URL\"/>\n            </if>\n         </choose>\n      </group>\n   </macro>\n   <macro name=\"sort-key\">\n      <text macro=\"contributors-sort\" suffix=\" \"/>\n      <text variable=\"title\" suffix=\" \"/>\n      <text variable=\"genre\"/>\n   </macro>\n   <citation et-al-min=\"4\" et-al-use-first=\"1\" et-al-subsequent-min=\"4\" et-al-subsequent-use-first=\"1\" disambiguate-add-names=\"true\">\n      <layout prefix=\"\" suffix=\".\" delimiter=\"; \">\n         <choose>\n            <if position=\"ibid-with-locator\">\n               <group delimiter=\", \">\n                  <text term=\"ibid\" text-case=\"capitalize-first\"/>\n                  <text macro=\"point-locators-subsequent\"/>\n               </group>\n            </if>\n            <else-if position=\"ibid\">\n               <text term=\"ibid\" text-case=\"capitalize-first\"/>\n            </else-if>\n            <else-if position=\"subsequent\">\n               <group delimiter=\", \">\n                  <text macro=\"contributors-short\"/>\n                  <text macro=\"title-short\"/>\n                  <text macro=\"point-locators-subsequent\"/>\n               </group>\n            </else-if>\n            <else>\n               <group delimiter=\", \">\n                  <text macro=\"contributors-note\"/>\n                  <text macro=\"title-note\"/>\n                  <text macro=\"description-note\"/>\n                  <text macro=\"secondary-contributors-note\"/>\n                  <text macro=\"container-title-note\"/>\n                  <text macro=\"container-contributors-note\"/>\n               </group>\n               <text macro=\"locators-note\"/>\n               <text macro=\"collection-title\" prefix=\", \"/>\n               <text macro=\"issue-note\"/>\n               <text macro=\"locators-newspaper\" prefix=\", \"/>\n               <text macro=\"point-locators\"/>\n               <text macro=\"access-note\" prefix=\", \"/>\n            </else>\n         </choose>\n      </layout>\n   </citation>\n   <bibliography hanging-indent=\"true\" et-al-min=\"11\" et-al-use-first=\"7\" subsequent-author-substitute=\"———\" entry-spacing=\"0\">\n      <sort>\n         <key macro=\"sort-key\"/>\n         <key variable=\"issued\"/>\n      </sort>\n      <layout suffix=\".\">\n         <group delimiter=\". \">\n            <text macro=\"contributors\"/>\n            <text macro=\"title\"/>\n            <text macro=\"description\"/>\n            <text macro=\"secondary-contributors\"/>\n            <group delimiter=\", \">\n               <text macro=\"container-title\"/>\n               <text macro=\"container-contributors\"/>\n               <text macro=\"locators-chapter\"/>\n            </group>\n         </group>\n         <text macro=\"locators\"/>\n         <text macro=\"collection-title\" prefix=\". \"/>\n         <text macro=\"issue\"/>\n         <text macro=\"locators-newspaper\" prefix=\", \"/>\n         <text macro=\"locators-journal\"/>\n         <text macro=\"access\" prefix=\". \"/>\n      </layout>\n   </bibliography>\n</style>','f71d5a92c23306568c1ca95b844520a4bbd7b7b9'),('http://www.zotero.org/styles/chicago-note-bibliography','Chicago Manual of Style (Note with Bibliography)','chicago-note-bibliography.csl','','Chicago format with short notes and full bibliography','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<style xmlns=\"http://purl.org/net/xbiblio/csl\" class=\"note\" version=\"1.0\" demote-non-dropping-particle=\"sort-only\">\n   <info>\n      <title>Chicago Manual of Style (Note with Bibliography)</title>\n      <id>http://www.zotero.org/styles/chicago-note-bibliography</id>\n      <link href=\"http://www.zotero.org/styles/chicago-note-bibliography\" rel=\"self\"/>\n      <link href=\"http://www.chicagomanualofstyle.org/tools_citationguide.html\" rel=\"documentation\"/>\n      <author>\n         <name>Julian Onions</name>\n         <email>julian.onions@gmail.com</email>\n      </author>\n      <contributor>\n         <name>Simon Kornblith</name>\n         <email>simon@simonster.com</email>\n      </contributor>\n      <contributor>\n         <name>Elena Razlogova</name>\n         <email>elena.razlogova@gmail.com</email>\n      </contributor>\n      <summary>Chicago format with short notes and full bibliography</summary>\n      <category field=\"generic-base\"/>\n      <category citation-format=\"numeric\"/>\n      <updated/>\n      <rights>This work is licensed under a Creative Commons Attribution-Share Alike 3.0 License: http://creativecommons.org/licenses/by-sa/3.0/</rights>\n   </info>\n   <macro name=\"secondary-contributors\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"none\">\n            <group delimiter=\". \">\n               <choose>\n                  <if variable=\"author\">\n                     <names variable=\"editor\" delimiter=\". \">\n                        <label form=\"verb\" text-case=\"capitalize-first\" suffix=\" \"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                  </if>\n               </choose>\n               <choose>\n                  <if variable=\"author editor\" match=\"any\">\n                     <names variable=\"translator\" delimiter=\". \">\n                        <label form=\"verb\" text-case=\"capitalize-first\" suffix=\" \"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                  </if>\n               </choose>\n            </group>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"container-contributors\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <group delimiter=\", \">\n               <choose>\n                  <if variable=\"author\">\n                     <names variable=\"editor\" delimiter=\", \">\n                        <label form=\"verb\" text-case=\"lowercase\" suffix=\" \"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                     <choose>\n                        <if variable=\"container-author\">\n                           <group>\n                              <names variable=\"container-author\">\n                                 <label form=\"verb-short\" prefix=\" \" text-case=\"lowercase\" suffix=\" \" strip-periods=\"true\"/>\n                                 <name and=\"text\" delimiter=\", \"/>\n                              </names>\n                           </group>\n                        </if>\n                     </choose>\n                  </if>\n               </choose>\n               <choose>\n                  <if variable=\"author editor\" match=\"any\">\n                     <names variable=\"translator\" delimiter=\", \">\n                        <label form=\"verb\" text-case=\"lowercase\" suffix=\" \"/>\n                        <name and=\"text\" delimiter=\", \"/>\n                     </names>\n                  </if>\n               </choose>\n            </group>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"editor\">\n      <names variable=\"editor\">\n         <name name-as-sort-order=\"first\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"short\" prefix=\", \" suffix=\".\" strip-periods=\"true\"/>\n      </names>\n   </macro>\n   <macro name=\"translator\">\n      <names variable=\"translator\">\n         <name name-as-sort-order=\"first\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"verb-short\" prefix=\", \" suffix=\".\" strip-periods=\"true\"/>\n      </names>\n   </macro>\n   <macro name=\"recipient-note\">\n      <names variable=\"recipient\" delimiter=\", \">\n         <label form=\"verb\" prefix=\" \" text-case=\"lowercase\" suffix=\" \"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"recipient\">\n      <choose>\n         <if type=\"personal_communication\">\n            <choose>\n               <if variable=\"genre\">\n                  <text variable=\"genre\" text-case=\"capitalize-first\"/>\n               </if>\n               <else>\n                  <text term=\"letter\" text-case=\"capitalize-first\"/>\n               </else>\n            </choose>\n         </if>\n      </choose>\n      <text macro=\"recipient-note\" prefix=\" \"/>\n   </macro>\n   <macro name=\"contributors\">\n      <names variable=\"author\">\n         <name name-as-sort-order=\"first\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <substitute>\n            <text macro=\"editor\"/>\n            <text macro=\"translator\"/>\n         </substitute>\n      </names>\n      <text macro=\"recipient\" prefix=\". \"/>\n   </macro>\n   <macro name=\"recipient-short\">\n      <names variable=\"recipient\">\n         <label form=\"verb\" prefix=\" \" text-case=\"lowercase\" suffix=\" \"/>\n         <name form=\"short\" and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"contributors-short\">\n      <names variable=\"author\">\n         <name form=\"short\" and=\"text\" delimiter=\", \"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n         </substitute>\n      </names>\n      <text macro=\"recipient-short\"/>\n   </macro>\n   <macro name=\"contributors-sort\">\n      <names variable=\"author\">\n         <name name-as-sort-order=\"all\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"verb-short\" prefix=\", \" suffix=\".\" strip-periods=\"true\"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"interviewer\">\n      <names variable=\"interviewer\" delimiter=\", \">\n         <label form=\"verb\" prefix=\" \" text-case=\"capitalize-first\" suffix=\" \"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"title\">\n      <choose>\n         <if variable=\"title\" match=\"none\">\n            <choose>\n               <if type=\"personal_communication\" match=\"none\">\n                  <text variable=\"genre\" text-case=\"capitalize-first\"/>\n               </if>\n            </choose>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\"/>\n         </else-if>\n         <else>\n            <text variable=\"title\" quotes=\"true\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"title-short\">\n      <choose>\n         <if variable=\"title\" match=\"none\">\n            <choose>\n               <if type=\"interview\">\n                  <text term=\"interview\" text-case=\"lowercase\"/>\n               </if>\n               <else-if type=\"manuscript speech\" match=\"any\">\n                  <text variable=\"genre\" form=\"short\"/>\n               </else-if>\n               <else-if type=\"personal_communication\">\n                  <text macro=\"issued\"/>\n               </else-if>\n            </choose>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" form=\"short\" font-style=\"italic\"/>\n         </else-if>\n         <else>\n            <text variable=\"title\" form=\"short\" quotes=\"true\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"description\">\n      <group delimiter=\", \">\n         <group delimiter=\". \">\n            <text macro=\"interviewer\"/>\n            <text variable=\"medium\" text-case=\"capitalize-first\"/>\n         </group>\n         <choose>\n            <if variable=\"title\" match=\"none\"/>\n            <else-if type=\"thesis speech\" match=\"any\"/>\n            <else>\n               <text variable=\"genre\" text-case=\"capitalize-first\"/>\n            </else>\n         </choose>\n      </group>\n   </macro>\n   <macro name=\"container-title\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <text term=\"in\" text-case=\"capitalize-first\" suffix=\" \"/>\n         </if>\n      </choose>\n      <choose>\n         <if type=\"legal_case\" match=\"none\">\n            <text variable=\"container-title\" font-style=\"italic\"/>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"edition\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <choose>\n               <if is-numeric=\"edition\">\n                  <group delimiter=\" \">\n                     <number variable=\"edition\" form=\"ordinal\"/>\n                     <text term=\"edition\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n                  </group>\n               </if>\n               <else>\n                  <text variable=\"edition\" text-case=\"capitalize-first\" suffix=\".\"/>\n               </else>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"collection-title\">\n      <text variable=\"collection-title\"/>\n      <text variable=\"collection-number\" prefix=\" \"/>\n   </macro>\n   <macro name=\"locators\">\n      <choose>\n         <if type=\"article-journal\">\n            <text variable=\"volume\" prefix=\" \"/>\n            <group prefix=\", \">\n               <text term=\"issue\" form=\"short\" suffix=\". \" strip-periods=\"true\"/>\n               <number variable=\"issue\"/>\n            </group>\n         </if>\n         <else-if type=\"legal_case\">\n            <text variable=\"volume\" prefix=\", \"/>\n            <text variable=\"container-title\" prefix=\" \"/>\n            <text variable=\"page\" prefix=\" \"/>\n         </else-if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <group prefix=\". \" delimiter=\". \">\n               <group>\n                  <text term=\"volume\" form=\"short\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n                  <number variable=\"volume\" form=\"numeric\"/>\n               </group>\n               <group>\n                  <number variable=\"number-of-volumes\" form=\"numeric\"/>\n                  <text term=\"volume\" form=\"short\" prefix=\" \" suffix=\".\" plural=\"true\" strip-periods=\"true\"/>\n               </group>\n               <text macro=\"edition\"/>\n            </group>\n         </else-if>\n         <else-if type=\"chapter paper-conference\" match=\"any\">\n            <group prefix=\". \" delimiter=\". \">\n               <choose>\n                  <if variable=\"page\" match=\"none\">\n                     <group>\n                        <text term=\"volume\" form=\"short\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n                        <number variable=\"volume\" form=\"numeric\"/>\n                     </group>\n                  </if>\n               </choose>\n               <text macro=\"edition\"/>\n            </group>\n         </else-if>\n      </choose>\n   </macro>\n   <macro name=\"locators-newspaper\">\n      <choose>\n         <if type=\"article-newspaper\">\n            <group delimiter=\", \">\n               <group>\n                  <text variable=\"edition\" suffix=\" \"/>\n                  <text term=\"edition\" prefix=\" \"/>\n               </group>\n               <group>\n                  <text term=\"section\" form=\"short\" suffix=\". \" strip-periods=\"true\"/>\n                  <text variable=\"section\"/>\n               </group>\n            </group>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"event\">\n      <group>\n         <text term=\"presented at\" suffix=\" \"/>\n         <text variable=\"event\"/>\n      </group>\n   </macro>\n   <macro name=\"publisher\">\n      <group delimiter=\": \">\n         <text variable=\"publisher-place\"/>\n         <text variable=\"publisher\"/>\n      </group>\n   </macro>\n   <macro name=\"issued\">\n      <choose>\n         <if variable=\"issued\">\n            <choose>\n               <if type=\"graphic report\" match=\"any\">\n                  <date variable=\"issued\">\n                     <date-part name=\"month\" suffix=\" \"/>\n                     <date-part name=\"day\" suffix=\", \"/>\n                     <date-part name=\"year\"/>\n                  </date>\n               </if>\n               <else-if type=\"legal_case\">\n                  <text variable=\"authority\" suffix=\" \"/>\n                  <date variable=\"issued\">\n                     <date-part name=\"year\"/>\n                  </date>\n               </else-if>\n               <else-if type=\"bill book graphic legal_case motion_picture report song thesis chapter paper-conference\" match=\"any\">\n                  <date variable=\"issued\">\n                     <date-part name=\"year\"/>\n                  </date>\n               </else-if>\n               <else>\n                  <date variable=\"issued\">\n                     <date-part name=\"month\" suffix=\" \"/>\n                     <date-part name=\"day\" suffix=\", \"/>\n                     <date-part name=\"year\"/>\n                  </date>\n               </else>\n            </choose>\n         </if>\n         <else>\n            <text term=\"no date\" form=\"short\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"locators-chapter\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <choose>\n               <if variable=\"page\">\n                  <text variable=\"volume\" suffix=\":\"/>\n                  <text variable=\"page\"/>\n               </if>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"locators-journal\">\n      <choose>\n         <if type=\"article-journal\">\n            <text variable=\"page\" prefix=\": \"/>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"point-locators-subsequent\">\n      <group>\n         <choose>\n            <if locator=\"page\" match=\"none\">\n               <choose>\n                  <if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n                     <choose>\n                        <if variable=\"volume\">\n                           <group>\n                              <text term=\"volume\" form=\"short\" text-case=\"lowercase\" suffix=\". \" strip-periods=\"true\"/>\n                              <number variable=\"volume\" form=\"numeric\"/>\n                              <label variable=\"locator\" form=\"short\" prefix=\", \" suffix=\" \"/>\n                           </group>\n                        </if>\n                        <else>\n                           <label variable=\"locator\" form=\"short\" suffix=\" \"/>\n                        </else>\n                     </choose>\n                  </if>\n               </choose>\n            </if>\n            <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n               <number variable=\"volume\" form=\"numeric\" suffix=\":\"/>\n            </else-if>\n         </choose>\n         <text variable=\"locator\"/>\n      </group>\n   </macro>\n   <macro name=\"archive\">\n      <group delimiter=\". \">\n         <text variable=\"archive_location\" text-case=\"capitalize-first\"/>\n         <text variable=\"archive\"/>\n         <text variable=\"archive-place\"/>\n      </group>\n   </macro>\n   <macro name=\"issue\">\n      <choose>\n         <if type=\"article-journal legal_case\" match=\"any\">\n            <text macro=\"issued\" prefix=\" (\" suffix=\")\"/>\n         </if>\n         <else-if type=\"speech\">\n            <choose>\n               <if variable=\"title\" match=\"none\"/>\n               <else>\n                  <text variable=\"genre\" text-case=\"capitalize-first\" prefix=\". \"/>\n               </else>\n            </choose>\n            <text macro=\"event\" prefix=\" \"/>\n            <text variable=\"event-place\" prefix=\", \"/>\n            <text macro=\"issued\" prefix=\", \"/>\n         </else-if>\n         <else-if variable=\"publisher-place publisher\" match=\"any\">\n            <group prefix=\". \" delimiter=\", \">\n               <choose>\n                  <if type=\"thesis\">\n                     <text variable=\"genre\" text-case=\"capitalize-first\"/>\n                  </if>\n               </choose>\n               <text macro=\"publisher\"/>\n               <text macro=\"issued\"/>\n            </group>\n         </else-if>\n         <else>\n            <text macro=\"issued\" prefix=\", \"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"access\">\n      <group delimiter=\". \">\n         <choose>\n            <if type=\"graphic report\" match=\"any\">\n               <text macro=\"archive\"/>\n            </if>\n            <else-if type=\"bill book graphic legal_case motion_picture report song article-journal article-magazine article-newspaper thesis chapter paper-conference\" match=\"none\">\n               <text macro=\"archive\"/>\n            </else-if>\n         </choose>\n         <choose>\n            <if type=\"legal_case\" match=\"none\">\n               <text variable=\"URL\"/>\n            </if>\n         </choose>\n      </group>\n   </macro>\n   <macro name=\"sort-key\">\n      <text macro=\"contributors-sort\" suffix=\" \"/>\n      <text variable=\"title\" suffix=\" \"/>\n      <text variable=\"genre\"/>\n   </macro>\n   <citation et-al-min=\"4\" et-al-use-first=\"1\" et-al-subsequent-min=\"4\" et-al-subsequent-use-first=\"1\" disambiguate-add-names=\"true\">\n      <layout prefix=\"\" suffix=\".\" delimiter=\"; \">\n         <choose>\n            <if position=\"ibid-with-locator\">\n               <group delimiter=\", \">\n                  <text term=\"ibid\" text-case=\"capitalize-first\"/>\n                  <text macro=\"point-locators-subsequent\"/>\n               </group>\n            </if>\n            <else-if position=\"ibid\">\n               <text term=\"ibid\" text-case=\"capitalize-first\"/>\n            </else-if>\n            <else>\n               <group delimiter=\", \">\n                  <text macro=\"contributors-short\"/>\n                  <text macro=\"title-short\"/>\n                  <text macro=\"point-locators-subsequent\"/>\n               </group>\n            </else>\n         </choose>\n      </layout>\n   </citation>\n   <bibliography hanging-indent=\"true\" et-al-min=\"11\" et-al-use-first=\"7\" subsequent-author-substitute=\"———\" entry-spacing=\"0\">\n      <sort>\n         <key macro=\"sort-key\"/>\n         <key variable=\"issued\"/>\n      </sort>\n      <layout suffix=\".\">\n         <group delimiter=\". \">\n            <text macro=\"contributors\"/>\n            <text macro=\"title\"/>\n            <text macro=\"description\"/>\n            <text macro=\"secondary-contributors\"/>\n            <group delimiter=\", \">\n               <text macro=\"container-title\"/>\n               <text macro=\"container-contributors\"/>\n               <text macro=\"locators-chapter\"/>\n            </group>\n         </group>\n         <text macro=\"locators\"/>\n         <text macro=\"collection-title\" prefix=\". \"/>\n         <text macro=\"issue\"/>\n         <text macro=\"locators-newspaper\" prefix=\", \"/>\n         <text macro=\"locators-journal\"/>\n         <text macro=\"access\" prefix=\". \"/>\n      </layout>\n   </bibliography>\n</style>','ac5956c95db5dc9635272adf5da8d83244acef74'),('http://www.zotero.org/styles/cse','Council of Science Editors','cse.csl','','The Council of Science Editors style.','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<style xmlns=\"http://purl.org/net/xbiblio/csl\" class=\"in-text\" version=\"1.0\" demote-non-dropping-particle=\"sort-only\">\n   <info>\n      <title>Council of Science Editors</title>\n      <id>http://www.zotero.org/styles/cse</id>\n      <link href=\"http://www.zotero.org/styles/cse\" rel=\"self\"/>\n      <author>\n         <name>Julian Onions</name>\n         <email>julian.onions@gmail.com</email>\n      </author>\n      <category citation-format=\"numeric\"/>\n      <category field=\"science\"/>\n      <updated/>\n      <summary>The Council of Science Editors style.</summary>\n      <link href=\"http://www.dianahacker.com/resdoc/p04_c11_s1.html\" rel=\"documentation\"/>\n      <rights>This work is licensed under a Creative Commons Attribution-Share Alike 3.0 License: http://creativecommons.org/licenses/by-sa/3.0/</rights>\n   </info>\n   <macro name=\"editor\">\n      <names variable=\"editor\">\n         <name name-as-sort-order=\"all\" sort-separator=\" \" initialize-with=\"\" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"long\" prefix=\", \" text-case=\"lowercase\" suffix=\".\"/>\n      </names>\n   </macro>\n   <macro name=\"anon\">\n      <text term=\"anonymous\" form=\"short\" text-case=\"capitalize-first\" strip-periods=\"true\"/>\n   </macro>\n   <macro name=\"author\">\n      <group suffix=\".\">\n         <names variable=\"author\">\n            <name name-as-sort-order=\"all\" sort-separator=\" \" initialize-with=\"\" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n            <label form=\"short\" prefix=\" \" suffix=\"\" text-case=\"lowercase\" strip-periods=\"true\"/>\n            <substitute>\n               <names variable=\"editor\"/>\n               <text macro=\"anon\"/>\n            </substitute>\n         </names>\n      </group>\n   </macro>\n   <macro name=\"author-short\">\n      <names variable=\"author\">\n         <name form=\"short\" and=\"symbol\" delimiter=\", \" initialize-with=\".\"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n            <text macro=\"anon\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"access\">\n      <group>\n         <text value=\"Available from:\" suffix=\" \"/>\n         <text variable=\"URL\"/>\n      </group>\n   </macro>\n   <macro name=\"title\">\n      <text variable=\"title\"/>\n   </macro>\n   <macro name=\"publisher\">\n      <group delimiter=\": \">\n         <text variable=\"publisher-place\"/>\n         <text variable=\"publisher\"/>\n      </group>\n   </macro>\n   <macro name=\"issued\">\n      <date variable=\"issued\" delimiter=\" \">\n         <date-part name=\"year\"/>\n         <date-part name=\"month\" prefix=\" \"/>\n         <date-part name=\"day\" prefix=\" \"/>\n      </date>\n      <group prefix=\" [\" suffix=\"]\" delimiter=\" \">\n         <text term=\"cited\"/>\n         <date variable=\"accessed\">\n            <date-part name=\"year\"/>\n            <date-part name=\"month\" prefix=\" \"/>\n            <date-part name=\"day\" prefix=\" \"/>\n         </date>\n      </group>\n   </macro>\n   <macro name=\"pages\">\n      <label variable=\"page\" form=\"short\" suffix=\". \" strip-periods=\"true\"/>\n      <text variable=\"page\"/>\n   </macro>\n   <macro name=\"journal\">\n      <text variable=\"container-title\"/>\n      <choose>\n         <if variable=\"URL\">\n            <text term=\"internet\" prefix=\" [\" suffix=\"]\" text-case=\"capitalize-first\"/>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"edition\">\n      <choose>\n         <if is-numeric=\"edition\">\n            <group delimiter=\" \">\n               <number variable=\"edition\" form=\"ordinal\"/>\n               <text term=\"edition\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n            </group>\n         </if>\n         <else>\n            <text variable=\"edition\" suffix=\".\"/>\n         </else>\n      </choose>\n   </macro>\n   <citation collapse=\"citation-number\">\n      <sort>\n         <key variable=\"citation-number\"/>\n      </sort>\n      <layout delimiter=\",\" vertical-align=\"sup\">\n         <text variable=\"citation-number\"/>\n         <group prefix=\"(\" suffix=\")\">\n            <label variable=\"locator\" form=\"short\" strip-periods=\"true\"/>\n            <text variable=\"locator\"/>\n         </group>\n      </layout>\n   </citation>\n   <bibliography hanging-indent=\"false\" et-al-min=\"10\" et-al-use-first=\"10\">\n      <layout>\n         <text variable=\"citation-number\" prefix=\"\" suffix=\". \"/>\n         <text macro=\"author\" suffix=\"\"/>\n         <choose>\n            <if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n               <group prefix=\" \" suffix=\".\" delimiter=\" \">\n                  <text macro=\"title\" suffix=\".\"/>\n                  <text macro=\"edition\"/>\n                  <text macro=\"editor\" prefix=\"(\" suffix=\")\"/>\n               </group>\n               <text prefix=\" \" suffix=\"\" macro=\"publisher\"/>\n               <group suffix=\".\" prefix=\"; \" delimiter=\" \">\n                  <date variable=\"issued\">\n                     <date-part name=\"year\"/>\n                  </date>\n                  <text macro=\"pages\"/>\n               </group>\n            </if>\n            <else-if type=\"chapter paper-conference\" match=\"any\">\n               <text macro=\"title\" prefix=\" \" suffix=\".\"/>\n               <group prefix=\" \" delimiter=\" \">\n                  <text term=\"in\" text-case=\"capitalize-first\" suffix=\":\"/>\n                  <text macro=\"editor\"/>\n                  <text variable=\"container-title\" suffix=\".\"/>\n                  <text variable=\"volume\" prefix=\"Vol. \" suffix=\".\"/>\n                  <text macro=\"edition\"/>\n                  <text variable=\"collection-title\" suffix=\".\"/>\n                  <group suffix=\".\">\n                     <text macro=\"publisher\"/>\n                     <group suffix=\".\" prefix=\"; \" delimiter=\". \">\n                        <date variable=\"issued\">\n                           <date-part name=\"year\"/>\n                        </date>\n                        <text macro=\"pages\"/>\n                     </group>\n                  </group>\n               </group>\n            </else-if>\n            <else-if type=\"patent\">\n              <group suffix=\".\" prefix=\"; \" delimiter=\" \">\n                  <date variable=\"issued\">\n                     <date-part name=\"year\"/>\n                  </date>\n               </group>\n               <group prefix=\" \" suffix=\".\" delimiter=\" \">\n                  <text macro=\"title\" suffix=\".\"/>\n               </group>\n               <text variable=\"edition\" prefix=\" \" suffix=\" patent\"/>\n               <text variable=\"section\" prefix=\" \"/>\n               <text variable=\"volume\" prefix=\" \" suffix=\".\"/>\n            </else-if>\n            <else>\n               <group suffix=\".\">\n                  <text macro=\"title\" prefix=\" \"/>\n                  <text macro=\"editor\" prefix=\" \"/>\n               </group>\n               <group prefix=\" \" suffix=\".\">\n                  <text macro=\"journal\" suffix=\".\"/>\n                  <group delimiter=\";\" prefix=\" \">\n                     <text macro=\"issued\"/>\n                     <group>\n                        <text variable=\"volume\"/>\n                        <text variable=\"issue\" prefix=\"(\" suffix=\")\"/>\n                     </group>\n                  </group>\n                  <text variable=\"page\" prefix=\":\"/>\n               </group>\n            </else>\n         </choose>\n         <text prefix=\" \" macro=\"access\"/>\n      </layout>\n   </bibliography>\n</style>','dfa73722aae6e8b0a9d2cd86708555c8950e75e0'),('http://www.zotero.org/styles/harvard1','Harvard Reference format 1 (Author-Date)','harvard1.csl','','The Harvard author-date style','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<style xmlns=\"http://purl.org/net/xbiblio/csl\" class=\"in-text\" version=\"1.0\" demote-non-dropping-particle=\"sort-only\">\n   <info>\n      <title>Harvard Reference format 1 (Author-Date)</title>\n      <id>http://www.zotero.org/styles/harvard1</id>\n      <link href=\"http://www.zotero.org/styles/harvard1\" rel=\"self\"/>\n      <author>\n         <name>Julian Onions</name>\n         <email>julian.onions@gmail.com</email>\n      </author>\n      <category citation-format=\"author-date\"/>\n      <category field=\"generic-base\"/>\n      <updated/>\n      <summary>The Harvard author-date style</summary>\n      <link href=\"http://libweb.anglia.ac.uk/referencing/harvard.htm\" rel=\"documentation\"/>\n      <rights>This work is licensed under a Creative Commons Attribution-Share Alike 3.0 License: http://creativecommons.org/licenses/by-sa/3.0/</rights>\n   </info>\n   <macro name=\"editor\">\n      <names variable=\"editor\" delimiter=\", \">\n         <name and=\"symbol\" initialize-with=\". \" delimiter=\", \"/>\n         <label form=\"short\" prefix=\", \" text-case=\"lowercase\" suffix=\".\" strip-periods=\"true\"/>\n      </names>\n   </macro>\n   <macro name=\"anon\">\n      <text term=\"anonymous\" form=\"short\" text-case=\"capitalize-first\" strip-periods=\"true\"/>\n   </macro>\n   <macro name=\"author\">\n      <names variable=\"author\">\n         <name name-as-sort-order=\"all\" and=\"symbol\" sort-separator=\", \" initialize-with=\".\" delimiter-precedes-last=\"never\" delimiter=\", \"/>\n         <label form=\"short\" prefix=\" \" suffix=\".\" text-case=\"lowercase\" strip-periods=\"true\"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <text macro=\"anon\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"author-short\">\n      <names variable=\"author\">\n         <name form=\"short\" and=\"symbol\" delimiter=\", \" delimiter-precedes-last=\"never\" initialize-with=\". \"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n            <text macro=\"anon\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"access\">\n      <group>\n         <text value=\"Available at:\" suffix=\" \"/>\n         <text variable=\"URL\"/>\n         <group prefix=\" [\" suffix=\"]\">\n            <text term=\"accessed\" text-case=\"capitalize-first\" suffix=\" \"/>\n            <date variable=\"accessed\">\n               <date-part name=\"month\" suffix=\" \"/>\n               <date-part name=\"day\" suffix=\", \"/>\n               <date-part name=\"year\"/>\n            </date>\n         </group>\n      </group>\n   </macro>\n   <macro name=\"title\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song thesis\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\"/>\n         </if>\n         <else>\n            <text variable=\"title\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"publisher\">\n      <group delimiter=\": \">\n         <text variable=\"publisher-place\"/>\n         <text variable=\"publisher\"/>\n      </group>\n   </macro>\n   <macro name=\"year-date\">\n      <choose>\n         <if variable=\"issued\">\n            <date variable=\"issued\">\n               <date-part name=\"year\"/>\n            </date>\n         </if>\n         <else>\n            <text term=\"no date\" form=\"short\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"edition\">\n      <choose>\n         <if is-numeric=\"edition\">\n            <group delimiter=\" \">\n               <number variable=\"edition\" form=\"ordinal\"/>\n               <text term=\"edition\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n            </group>\n         </if>\n         <else>\n            <text variable=\"edition\" suffix=\".\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"pages\">\n      <group>\n         <label variable=\"page\" form=\"short\" suffix=\" \"/>\n         <text variable=\"page\"/>\n      </group>\n   </macro>\n   <citation et-al-min=\"3\" et-al-use-first=\"1\" et-al-subsequent-min=\"3\" et-al-subsequent-use-first=\"1\" disambiguate-add-year-suffix=\"true\" disambiguate-add-names=\"true\" disambiguate-add-givenname=\"true\">\n      <layout prefix=\"(\" suffix=\")\" delimiter=\"; \">\n         <group delimiter=\", \">\n            <group delimiter=\" \">\n               <text macro=\"author-short\"/>\n               <text macro=\"year-date\"/>\n            </group>\n            <group>\n               <label variable=\"locator\" suffix=\".\" form=\"short\" strip-periods=\"true\"/>\n               <text variable=\"locator\"/>\n            </group>\n         </group>\n      </layout>\n   </citation>\n   <bibliography hanging-indent=\"true\" et-al-min=\"4\" et-al-use-first=\"1\">\n      <sort>\n         <key macro=\"author\"/>\n         <key variable=\"title\"/>\n      </sort>\n      <layout>\n         <text macro=\"author\" suffix=\",\"/>\n         <date variable=\"issued\" prefix=\" \" suffix=\".\">\n            <date-part name=\"year\"/>\n         </date>\n         <choose>\n            <if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n               <group prefix=\" \" delimiter=\" \" suffix=\",\">\n                  <text macro=\"title\"/>\n                  <text macro=\"edition\"/>\n                  <text macro=\"editor\"/>\n               </group>\n               <text prefix=\" \" suffix=\".\" macro=\"publisher\"/>\n            </if>\n            <else-if type=\"chapter paper-conference\" match=\"any\">\n               <text macro=\"title\" prefix=\" \" suffix=\".\"/>\n               <group prefix=\" \" delimiter=\" \">\n                  <text term=\"in\" text-case=\"capitalize-first\"/>\n                  <text macro=\"editor\"/>\n                  <text variable=\"container-title\" font-style=\"italic\" suffix=\".\"/>\n                  <text variable=\"collection-title\" suffix=\".\"/>\n                  <text variable=\"event\" suffix=\".\"/>\n                  <group suffix=\".\" delimiter=\", \">\n                     <text macro=\"publisher\" prefix=\" \"/>\n                     <text macro=\"pages\"/>\n                  </group>\n               </group>\n            </else-if>\n            <else-if type=\"thesis\">\n               <group prefix=\" \" suffix=\".\" delimiter=\". \">\n                  <text macro=\"title\"/>\n                  <text variable=\"genre\"/>\n                  <text macro=\"publisher\"/>\n               </group>\n            </else-if>\n            <else>\n               <group suffix=\".\">\n                  <text macro=\"title\" prefix=\" \"/>\n                  <text macro=\"editor\" prefix=\" \"/>\n               </group>\n               <group prefix=\" \" suffix=\".\">\n                  <text variable=\"container-title\" font-style=\"italic\"/>\n                  <group prefix=\", \">\n                     <text variable=\"volume\"/>\n                     <text variable=\"issue\" prefix=\"(\" suffix=\")\"/>\n                  </group>\n                  <group prefix=\", \">\n                     <label variable=\"page\" suffix=\".\" form=\"short\" strip-periods=\"true\"/>\n                     <text variable=\"page\"/>\n                  </group>\n               </group>\n            </else>\n         </choose>\n         <text prefix=\" \" macro=\"access\" suffix=\".\"/>\n      </layout>\n   </bibliography>\n</style>','9504782434fcf204adecf38ce3d7ae7b42c8aa70'),('http://www.zotero.org/styles/ieee','IEEE','ieee.csl','','','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<style xmlns=\"http://purl.org/net/xbiblio/csl\" class=\"in-text\" version=\"1.0\" demote-non-dropping-particle=\"sort-only\">\n   <info>\n      <title>IEEE</title>\n      <id>http://www.zotero.org/styles/ieee</id>\n      <link href=\"http://www.zotero.org/styles/ieee\" rel=\"self\"/>\n      <author>\n         <name>Michael Berkowitz</name>\n         <email>mberkowi@gmu.edu</email>\n      </author>\n      <contributor>\n         <name>Julian Onions</name>\n         <email>julian.onions@gmail.com</email>\n      </contributor>\n      <contributor>\n         <name>Rintze Zelle</name>\n         <uri>http://forums.zotero.org/account/831/</uri>\n      </contributor>\n      <contributor>\n         <name>Stephen Frank</name>\n         <uri>http://www.zotero.org/sfrank</uri>\n      </contributor>\n      <category field=\"engineering\"/>\n      <category field=\"generic-base\"/>\n      <category citation-format=\"numeric\"/>\n      <updated>2010-08-25T11:00:00+06:00</updated>\n      <rights>\n      This work is licensed under a Creative Commons Attribution-Share Alike 3.0 License:\n      http://creativecommons.org/licenses/by-sa/3.0/\n    </rights>\n      <link href=\"http://www.ieee.org/portal/cms_docs_iportals/iportals/publications/authors/transjnl/stylemanual.pdf\" rel=\"documentation\"/>\n      <link href=\"http://www.ieee.org/documents/auinfo07.pdf\" rel=\"documentation\"/>\n   </info><!-- Macros -->\n   <macro name=\"edition\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <choose>\n               <if is-numeric=\"edition\">\n                  <group delimiter=\" \">\n                     <number variable=\"edition\" form=\"ordinal\"/>\n                     <text term=\"edition\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n                  </group>\n               </if>\n               <else>\n                  <text variable=\"edition\" text-case=\"capitalize-first\" suffix=\".\"/>\n               </else>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"issued\">\n      <choose>\n         <if type=\"article-journal\">\n            <date variable=\"issued\">\n               <date-part name=\"month\" form=\"short\" suffix=\". \" strip-periods=\"true\"/>\n               <date-part name=\"year\" form=\"long\"/>\n            </date>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song thesis chapter paper-conference\" match=\"any\">\n            <date variable=\"issued\">\n               <date-part name=\"year\" form=\"long\"/>\n            </date>\n         </else-if>\n         <else>\n            <date variable=\"issued\">\n               <date-part name=\"day\" form=\"numeric-leading-zeros\" suffix=\"-\"/>\n               <date-part name=\"month\" form=\"short\" suffix=\"-\" strip-periods=\"true\"/>\n               <date-part name=\"year\" form=\"long\"/>\n            </date>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"author\">\n      <names variable=\"author\">\n         <name initialize-with=\". \" delimiter=\", \" and=\"text\"/>\n         <label form=\"short\" prefix=\", \" text-case=\"capitalize-first\" suffix=\".\" strip-periods=\"true\"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"editor\">\n      <names variable=\"editor\">\n         <name initialize-with=\". \" delimiter=\", \" and=\"text\"/>\n         <label form=\"short\" prefix=\", \" text-case=\"capitalize-first\" suffix=\".\" strip-periods=\"true\"/>\n      </names>\n   </macro>\n   <macro name=\"locators\">\n      <group delimiter=\", \">\n         <text macro=\"edition\"/>\n         <group delimiter=\" \">\n            <text term=\"volume\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n            <number variable=\"volume\" form=\"numeric\"/>\n         </group>\n         <group delimiter=\" \">\n            <number variable=\"number-of-volumes\" form=\"numeric\"/>\n            <text term=\"volume\" form=\"short\" suffix=\".\" plural=\"true\" strip-periods=\"true\"/>\n         </group>\n         <group delimiter=\" \">\n            <text term=\"issue\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n            <number variable=\"issue\" form=\"numeric\"/>\n         </group>\n      </group>\n   </macro>\n   <macro name=\"title\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\"/>\n         </if>\n         <else>\n            <text variable=\"title\" quotes=\"true\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"publisher\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <text variable=\"publisher-place\" suffix=\": \"/>\n            <text variable=\"publisher\"/>\n         </if>\n         <else>\n            <text variable=\"publisher\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"event\">\n      <choose>\n         <if type=\"paper-conference\">\n            <choose><!-- Published Conference Paper -->\n               <if variable=\"container-title\">\n                  <group delimiter=\", \">\n                     <text variable=\"container-title\" prefix=\"in \" font-style=\"italic\"/>\n                     <text variable=\"event-place\"/>\n                  </group>\n               </if><!-- Unpublished Conference Paper -->\n               <else>\n                  <group delimiter=\", \">\n                     <text variable=\"event\" prefix=\"presented at the \"/>\n                     <text variable=\"event-place\"/>\n                  </group>\n               </else>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"access\">\n      <choose>\n         <if type=\"webpage\">\n            <group delimiter=\". \">\n               <text value=\"[Online]\"/>\n               <text variable=\"URL\" prefix=\"Available: \"/>\n               <group prefix=\"[\" suffix=\"]\">\n                  <date variable=\"accessed\" prefix=\"Accessed: \">\n                     <date-part name=\"day\" form=\"numeric-leading-zeros\" suffix=\"-\"/>\n                     <date-part name=\"month\" form=\"short\" suffix=\"-\" strip-periods=\"true\"/>\n                     <date-part name=\"year\" form=\"long\"/>\n                  </date>\n               </group>\n            </group>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"page\">\n      <group>\n         <label variable=\"page\" form=\"short\" suffix=\". \" strip-periods=\"true\"/>\n         <text variable=\"page\"/>\n      </group>\n   </macro><!-- Citation -->\n   <citation et-al-min=\"7\" et-al-use-first=\"1\" collapse=\"citation-number\">\n      <sort>\n         <key variable=\"citation-number\"/>\n      </sort>\n      <layout prefix=\"[\" suffix=\"]\" delimiter=\"], [\">\n         <text variable=\"citation-number\"/>\n      </layout>\n   </citation><!-- Bibliography -->\n   <bibliography et-al-min=\"7\" et-al-use-first=\"1\" entry-spacing=\"0\" second-field-align=\"flush\">\n      <layout suffix=\".\"><!-- Citation Number -->\n         <text variable=\"citation-number\" prefix=\"[\" suffix=\"]\"/><!-- Author(s) -->\n         <text macro=\"author\" prefix=\" \" suffix=\", \"/><!-- Rest of Citation -->\n         <choose><!-- Specific Formats -->\n            <if type=\"article-journal\">\n               <group delimiter=\", \">\n                  <text macro=\"title\"/>\n                  <text variable=\"container-title\" font-style=\"italic\"/>\n                  <text macro=\"locators\"/>\n                  <text macro=\"page\"/>\n                  <text macro=\"issued\"/>\n               </group>\n            </if>\n            <else-if type=\"paper-conference\">\n               <group delimiter=\", \">\n                  <text macro=\"title\"/>\n                  <text macro=\"event\"/>\n                  <text macro=\"issued\"/>\n                  <text macro=\"locators\"/>\n                  <text macro=\"page\"/>\n               </group>\n            </else-if>\n            <else-if type=\"thesis\">\n               <group delimiter=\", \">\n                  <text macro=\"title\"/>\n                  <text variable=\"genre\"/>\n                  <text macro=\"publisher\"/>\n                  <text macro=\"issued\"/>\n               </group>\n            </else-if>\n            <else-if type=\"webpage\">\n               <group delimiter=\", \" suffix=\". \">\n                  <text macro=\"title\"/>\n                  <text variable=\"container-title\" font-style=\"italic\"/>\n                  <text macro=\"issued\"/>\n               </group>\n               <text macro=\"access\"/>\n            </else-if>\n            <else-if type=\"patent\">\n               <text macro=\"title\" suffix=\", \"/>\n               <text variable=\"section\" suffix=\" Patent:\"/>\n               <text variable=\"volume\" prefix=\" \"/>\n               <text macro=\"issued\" prefix=\", \"/>\n            </else-if><!-- Generic/Fallback Formats -->\n            <else-if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n               <group delimiter=\", \" suffix=\". \">\n                  <text macro=\"title\"/>\n                  <text macro=\"locators\"/>\n               </group>\n               <group delimiter=\", \">\n                  <text macro=\"publisher\"/>\n                  <text macro=\"issued\"/>\n                  <text macro=\"page\"/>\n               </group>\n            </else-if>\n            <else-if type=\"article-journal article-magazine article-newspaper broadcast interview manuscript map patent personal_communication song speech thesis webpage\" match=\"any\">\n               <group delimiter=\", \">\n                  <text macro=\"title\"/>\n                  <text variable=\"container-title\" font-style=\"italic\"/>\n                  <text macro=\"locators\"/>\n                  <text macro=\"publisher\"/>\n                  <text macro=\"page\"/>\n                  <text macro=\"issued\"/>\n               </group>\n            </else-if>\n            <else-if type=\"chapter paper-conference\" match=\"any\">\n               <group delimiter=\", \" suffix=\", \">\n                  <text macro=\"title\"/>\n                  <text variable=\"container-title\" prefix=\"in \" font-style=\"italic\"/>\n                  <text macro=\"locators\"/>\n               </group>\n               <text macro=\"editor\" suffix=\" \"/>\n               <group delimiter=\", \">\n                  <text macro=\"publisher\"/>\n                  <text macro=\"issued\"/>\n                  <text macro=\"page\"/>\n               </group>\n            </else-if>\n            <else>\n               <group delimiter=\", \" suffix=\". \">\n                  <text macro=\"title\"/>\n                  <text variable=\"container-title\" font-style=\"italic\"/>\n                  <text macro=\"locators\"/>\n               </group>\n               <group delimiter=\", \">\n                  <text macro=\"publisher\"/>\n                  <text macro=\"page\"/>\n                  <text macro=\"issued\"/>\n               </group>\n            </else>\n         </choose>\n      </layout>\n   </bibliography>\n</style>','493fa19e964dc316ef3a80ec6d88f9c0af249915'),('http://www.zotero.org/styles/mhra','Modern Humanities Research Association (Note with Bibliography)','mhra.csl','','MHRA format with full notes and bibliography','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<style xmlns=\"http://purl.org/net/xbiblio/csl\" class=\"note\" version=\"1.0\" demote-non-dropping-particle=\"sort-only\">\n   <info>\n      <title>Modern Humanities Research Association (Note with Bibliography)</title>\n      <id>http://www.zotero.org/styles/mhra</id>\n      <link href=\"http://www.zotero.org/styles/mhra\" rel=\"self\"/>\n      <link href=\"http://www.mhra.org.uk/Publications/Books/StyleGuide/download.shtml\" rel=\"documentation\"/>\n      <author>\n         <name>Rintze Zelle</name>\n         <uri>http://forums.zotero.org/account/831/</uri>\n      </author>\n      <contributor>\n         <name>Sebastian Karcher</name>\n      </contributor>\n      <summary>MHRA format with full notes and bibliography</summary>\n      <category field=\"generic-base\"/>\n      <category citation-format=\"note\"/>\n      <updated>2009-12-15T12:42:52+00:00</updated>\n      <rights>This work is licensed under a Creative Commons Attribution-Share Alike 3.0 License: http://creativecommons.org/licenses/by-sa/3.0/</rights>\n   </info>\n   <locale xml:lang=\"en\">\n      <terms>\n         <term name=\"et-al\">and others</term>\n         <term name=\"editor\" form=\"verb-short\">ed. by</term>\n         <term name=\"edition\" form=\"short\">edn</term>\n         <term name=\"translator\" form=\"verb-short\">trans. by</term>\n      </terms>\n   </locale>\n   <macro name=\"author\">\n      <names variable=\"author\">\n         <name name-as-sort-order=\"first\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"short\" prefix=\", \" suffix=\".\"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n            <text macro=\"title-note\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"contributors-note\">\n      <names variable=\"author\">\n         <name and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"never\"/>\n      </names>\n      <text macro=\"recipient-note\"/>\n   </macro>\n   <macro name=\"title-note\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\" text-case=\"title\"/>\n         </if>\n         <else>\n            <text variable=\"title\" prefix=\"‘\" suffix=\"’\" text-case=\"title\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"editor-translator\">\n      <group delimiter=\", \">\n         <names variable=\"editor\" delimiter=\", \">\n            <label form=\"verb-short\" text-case=\"lowercase\" suffix=\" \"/>\n            <name and=\"text\" delimiter=\", \" delimiter-precedes-last=\"never\"/>\n         </names>\n         <choose>\n            <if variable=\"author editor\" match=\"any\">\n               <names variable=\"translator\" delimiter=\", \">\n                  <label form=\"verb-short\" text-case=\"lowercase\" suffix=\" \"/>\n                  <name and=\"text\" delimiter=\", \" delimiter-precedes-last=\"never\"/>\n               </names>\n            </if>\n         </choose>\n      </group>\n   </macro>\n   <macro name=\"collection-title\">\n      <text variable=\"collection-title\" text-case=\"title\"/>\n      <text variable=\"collection-number\" prefix=\", \"/>\n   </macro>\n   <macro name=\"locators-note\">\n      <choose>\n         <if type=\"article-journal\">\n            <text variable=\"volume\"/>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <group delimiter=\", \">\n               <text macro=\"edition-note\"/>\n               <group>\n                  <number variable=\"number-of-volumes\" form=\"numeric\"/>\n                  <text term=\"volume\" form=\"short\" prefix=\" \" plural=\"true\"/>\n               </group>\n            </group>\n         </else-if>\n      </choose>\n   </macro>\n   <macro name=\"volume\">\n      <choose>\n         <if type=\"article-journal\">\n            <text variable=\"volume\"/>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <group delimiter=\", \">\n               <text macro=\"edition-note\"/>\n               <group>\n                  <number variable=\"number-of-volumes\" form=\"numeric\"/>\n                  <text term=\"volume\" form=\"short\" prefix=\" \" plural=\"true\"/>\n               </group>\n            </group>\n         </else-if>\n      </choose>\n   </macro>\n   <macro name=\"issue-note\">\n      <choose>\n         <if type=\"article-journal\">\n            <choose>\n               <if variable=\"volume\">\n                  <text macro=\"issued\" prefix=\" (\" suffix=\")\"/>\n               </if>\n               <else>\n                  <text macro=\"issued\" prefix=\", \"/>\n               </else>\n            </choose>\n         </if>\n         <else-if variable=\"publisher-place publisher\" match=\"any\">\n            <group prefix=\" (\" suffix=\")\" delimiter=\", \">\n               <group delimiter=\" \">\n                  <choose>\n                     <if variable=\"title\" match=\"none\"/>\n                     <else-if type=\"thesis speech\" match=\"any\">\n                        <text variable=\"genre\" prefix=\"unpublished \"/>\n                     </else-if>\n                  </choose>\n                  <text macro=\"event\"/>\n               </group>\n               <text macro=\"publisher\"/>\n               <text macro=\"issued\"/>\n            </group>\n         </else-if>\n         <else>\n            <text macro=\"issued\" prefix=\", \"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"locators-specific-note\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <choose>\n               <if is-numeric=\"volume\">\n                  <number variable=\"volume\" form=\"roman\" font-variant=\"small-caps\"/>\n               </if>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"container-title-note\">\n      <choose>\n         <if type=\"chapter paper-conference\" match=\"any\">\n            <text term=\"in\" text-case=\"lowercase\" suffix=\" \"/>\n         </if>\n      </choose>\n      <text variable=\"container-title\" font-style=\"italic\" text-case=\"title\"/>\n   </macro>\n   <macro name=\"edition-note\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song chapter paper-conference\" match=\"any\">\n            <choose>\n               <if is-numeric=\"edition\">\n                  <group delimiter=\" \">\n                     <number variable=\"edition\" form=\"ordinal\"/>\n                     <text term=\"edition\" form=\"short\"/>\n                  </group>\n               </if>\n               <else>\n                  <text variable=\"edition\"/>\n               </else>\n            </choose>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"editor-note\">\n      <names variable=\"editor\">\n         <name and=\"text\" sort-separator=\", \" delimiter=\", \"/>\n         <label form=\"short\" prefix=\", \" suffix=\".\"/>\n      </names>\n   </macro>\n   <macro name=\"translator-note\">\n      <names variable=\"translator\">\n         <name and=\"text\" sort-separator=\", \" delimiter=\", \"/>\n         <label form=\"verb-short\" prefix=\", \" suffix=\".\"/>\n      </names>\n   </macro>\n   <macro name=\"recipient-note\">\n      <names variable=\"recipient\" delimiter=\", \">\n         <label form=\"verb\" prefix=\" \" text-case=\"lowercase\" suffix=\" \"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"recipient-short\">\n      <names variable=\"recipient\">\n         <label form=\"verb\" prefix=\" \" text-case=\"lowercase\" suffix=\" \"/>\n         <name form=\"short\" and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"contributors-short\">\n      <names variable=\"author\">\n         <name form=\"short\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"never\"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n         </substitute>\n      </names>\n      <text macro=\"recipient-short\"/>\n   </macro>\n   <macro name=\"interviewer-note\">\n      <names variable=\"interviewer\" delimiter=\", \">\n         <label form=\"verb\" prefix=\" \" text-case=\"lowercase\" suffix=\" \"/>\n         <name and=\"text\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"locators-newspaper\">\n      <choose>\n         <if type=\"article-newspaper\">\n            <group delimiter=\", \">\n               <group>\n                  <text variable=\"edition\" suffix=\" \"/>\n                  <text term=\"edition\" prefix=\" \"/>\n               </group>\n               <group>\n                  <text term=\"section\" suffix=\" \"/>\n                  <text variable=\"section\"/>\n               </group>\n            </group>\n         </if>\n      </choose>\n   </macro>\n   <macro name=\"event\">\n      <group>\n         <text term=\"presented at\" suffix=\" \"/>\n         <text variable=\"event\"/>\n      </group>\n   </macro>\n   <macro name=\"publisher\">\n      <group delimiter=\": \">\n         <text variable=\"publisher-place\"/>\n         <text variable=\"publisher\"/>\n      </group>\n   </macro>\n   <macro name=\"issued\">\n      <choose>\n         <if type=\"graphic report article-newspaper\" match=\"any\">\n            <date variable=\"issued\">\n               <date-part name=\"day\" suffix=\" \"/>\n               <date-part name=\"month\" suffix=\" \"/>\n               <date-part name=\"year\"/>\n            </date>\n         </if>\n         <else-if type=\"bill book graphic legal_case motion_picture report song thesis chapter paper-conference\" match=\"any\">\n            <date variable=\"issued\">\n               <date-part name=\"year\"/>\n            </date>\n         </else-if>\n         <else>\n            <date variable=\"issued\">\n               <date-part name=\"year\"/>\n            </date>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"pages\">\n      <choose>\n         <if type=\"article-journal\">\n            <text variable=\"page\" prefix=\", \"/>\n         </if>\n         <else>\n            <choose>\n               <if variable=\"volume\">\n                  <text variable=\"page\" prefix=\", \"/>\n               </if>\n               <else>\n                  <label variable=\"page\" form=\"short\" prefix=\", \" suffix=\" \"/>\n                  <text variable=\"page\"/>\n               </else>\n            </choose>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"point-locators\">\n      <text macro=\"pages\"/>\n      <choose>\n         <if variable=\"page\">\n            <group prefix=\" (\" suffix=\")\">\n               <label variable=\"locator\" form=\"short\" suffix=\" \"/>\n               <text variable=\"locator\"/>\n            </group>\n         </if>\n         <else>\n            <label variable=\"locator\" form=\"short\" prefix=\", \" suffix=\" \"/>\n            <text variable=\"locator\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"archive-note\">\n      <group delimiter=\", \">\n         <text variable=\"archive_location\"/>\n         <text variable=\"archive\"/>\n         <text variable=\"archive-place\"/>\n      </group>\n   </macro>\n   <macro name=\"access-note\">\n      <group delimiter=\", \">\n         <choose>\n            <if type=\"graphic report\" match=\"any\">\n               <text macro=\"archive-note\" prefix=\", \"/>\n            </if>\n            <else-if type=\"bill book graphic legal_case motion_picture report song article-journal article-magazine article-newspaper thesis chapter paper-conference\" match=\"none\">\n               <text macro=\"archive-note\" prefix=\", \"/>\n            </else-if>\n         </choose>\n      </group>\n      <choose>\n         <if variable=\"DOI\">\n            <text variable=\"DOI\" prefix=\" &lt;doi:\" suffix=\"&gt;\"/>\n         </if>\n         <else>\n            <text variable=\"URL\" prefix=\" &lt;\" suffix=\"&gt;\"/>\n            <group prefix=\" [\" suffix=\"]\">\n               <text term=\"accessed\" text-case=\"lowercase\"/>\n               <date variable=\"accessed\">\n                  <date-part name=\"day\" prefix=\" \"/>\n                  <date-part name=\"month\" prefix=\" \"/>\n                  <date-part name=\"year\" prefix=\" \"/>\n               </date>\n            </group>\n         </else>\n      </choose>\n   </macro>\n   <citation et-al-min=\"4\" et-al-use-first=\"1\" et-al-subsequent-min=\"4\" et-al-subsequent-use-first=\"1\" disambiguate-add-names=\"true\" disambiguate-add-givenname=\"true\">\n      <layout prefix=\"\" suffix=\".\" delimiter=\"; \">\n         <choose>\n            <if position=\"subsequent\">\n               <text macro=\"contributors-short\"/>\n               <text macro=\"locators-specific-note\" prefix=\", \"/>\n               <text macro=\"point-locators\"/>\n            </if>\n            <else>\n               <group delimiter=\", \">\n                  <text macro=\"contributors-note\"/>\n                  <text macro=\"title-note\"/>\n                  <text macro=\"container-title-note\"/>\n                  <text macro=\"editor-translator\"/>\n                  <text macro=\"collection-title\"/>\n                  <text macro=\"locators-note\"/>\n               </group>\n               <text macro=\"issue-note\"/>\n               <text macro=\"locators-specific-note\" prefix=\", \"/>\n               <text macro=\"locators-newspaper\" prefix=\", \"/>\n               <text macro=\"point-locators\"/>\n               <text macro=\"access-note\"/>\n            </else>\n         </choose>\n      </layout>\n   </citation>\n   <bibliography hanging-indent=\"true\" et-al-min=\"6\" et-al-use-first=\"6\" subsequent-author-substitute=\"---\">\n      <sort>\n         <key macro=\"author\"/>\n         <key variable=\"title\"/>\n      </sort>\n      <layout suffix=\".\">\n         <group delimiter=\", \">\n            <text macro=\"author\"/>\n            <text macro=\"title-note\"/>\n            <text macro=\"container-title-note\"/>\n            <text macro=\"editor-translator\"/>\n            <text macro=\"collection-title\"/>\n            <text macro=\"volume\"/>\n         </group>\n         <text macro=\"issue-note\"/>\n         <text macro=\"locators-specific-note\" prefix=\", \"/>\n         <text macro=\"locators-newspaper\" prefix=\", \"/>\n         <text macro=\"pages\"/>\n         <text macro=\"access-note\"/>\n      </layout>\n   </bibliography>\n</style>','49c7898dcdf407953a60f2b27295f92db7cea93c'),('http://www.zotero.org/styles/mla','Modern Language Association','mla.csl','','This style requires the \"Include URLs\" box to be checked in the Style tab of the Zotero preferences','<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<style xmlns=\"http://purl.org/net/xbiblio/csl\" class=\"in-text\" version=\"1.0\" demote-non-dropping-particle=\"sort-only\">\n   <info>\n      <title>Modern Language Association</title>\n      <id>http://www.zotero.org/styles/mla</id>\n      <link href=\"http://www.zotero.org/styles/mla\" rel=\"self\"/>\n      <author>\n         <name>modified by Sebastian Karcher</name>\n         <email>karcher@u.northwestern.edu</email>\n      </author>\n      <contributor>\n         <name>modified by Christian Werthschulte</name>\n         <email>Christian.Werthschulte@rub.de</email>\n      </contributor>\n      <contributor>\n         <name>Simon Kornblith</name>\n         <email>simon@simonster.com</email>\n      </contributor>\n      <contributor>\n         <name>modified by James Johnston</name>\n         <email>thejamesjohnston@gmail.com</email>\n      </contributor>\n      <category field=\"generic-base\"/>\n      <category citation-format=\"author-date\"/>\n      <link href=\"http://owl.english.purdue.edu/owl/section/2/11/\" rel=\"documentation\"/>\n      <updated>2009-11-10T07:33:51+00:00</updated>\n      <summary>This style requires the \"Include URLs\" box to be checked in the Style tab of the Zotero preferences</summary>\n      <rights>This work is licensed under a Creative Commons Attribution-Share Alike 3.0 License: http://creativecommons.org/licenses/by-sa/3.0/</rights>\n   </info>\n   <locale xml:lang=\"en\">\n      <terms>\n         <term name=\"month-01\" form=\"short\">Jan.</term>\n         <term name=\"month-02\" form=\"short\">Feb.</term>\n         <term name=\"month-03\" form=\"short\">Mar.</term>\n         <term name=\"month-04\" form=\"short\">Apr.</term>\n         <term name=\"month-05\" form=\"short\">May</term>\n         <term name=\"month-06\" form=\"short\">June</term>\n         <term name=\"month-07\" form=\"short\">July</term>\n         <term name=\"month-08\" form=\"short\">Aug.</term>\n         <term name=\"month-09\" form=\"short\">Sept.</term>\n         <term name=\"month-10\" form=\"short\">Oct.</term>\n         <term name=\"month-11\" form=\"short\">Nov.</term>\n         <term name=\"month-12\" form=\"short\">Dec.</term>\n      </terms>\n   </locale>\n   <macro name=\"editor-translator\">\n      <names variable=\"editor translator\" delimiter=\". \">\n         <label form=\"verb-short\" text-case=\"capitalize-first\" suffix=\". \" strip-periods=\"true\"/>\n         <name and=\"symbol\" delimiter=\", \"/>\n      </names>\n   </macro>\n   <macro name=\"author\">\n      <names variable=\"author\">\n         <name name-as-sort-order=\"first\" and=\"text\" sort-separator=\", \" delimiter=\", \" delimiter-precedes-last=\"always\"/>\n         <label form=\"short\" prefix=\", \" suffix=\".\" strip-periods=\"true\"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n            <text macro=\"title\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"author-short\">\n      <names variable=\"author\">\n         <name form=\"short\" and=\"text\" delimiter=\", \" initialize-with=\". \"/>\n         <substitute>\n            <names variable=\"editor\"/>\n            <names variable=\"translator\"/>\n            <text macro=\"title-short\"/>\n         </substitute>\n      </names>\n   </macro>\n   <macro name=\"access\">\n      <group delimiter=\" \">\n         <date variable=\"accessed\">\n            <date-part name=\"day\" suffix=\" \"/>\n            <date-part name=\"month\" form=\"short\" suffix=\" \" strip-periods=\"true\"/>\n            <date-part name=\"year\"/>\n         </date>\n      </group>\n   </macro>\n   <macro name=\"medium\">\n      <choose>\n         <if type=\"motion_picture\">\n            <choose>\n               <if variable=\"medium\">\n                  <text variable=\"medium\" prefix=\" \"/>\n               </if>\n               <else>\n                  <text value=\"Film\" prefix=\" \"/>\n               </else>\n            </choose>\n         </if>\n         <else-if type=\"song\">\n            <choose>\n               <if variable=\"medium\">\n                  <text variable=\"medium\" prefix=\" \"/>\n               </if>\n               <else>\n                  <text value=\"Audio Recording\" prefix=\" \"/>\n               </else>\n            </choose>\n         </else-if>\n         <else>\n            <choose>\n               <if variable=\"URL DOI\" match=\"any\">\n                  <text variable=\"archive\" prefix=\" \" suffix=\". \"/>\n                  <text value=\"Web\" prefix=\" \"/>\n                  <text prefix=\". \" suffix=\".\" macro=\"access\"/>\n               </if>\n               <else>\n                  <text value=\"Print\" prefix=\" \"/>\n               </else>\n            </choose>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"title\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" font-style=\"italic\" text-case=\"title\"/>\n         </if>\n         <else>\n            <text variable=\"title\" quotes=\"true\" text-case=\"title\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"title-short\">\n      <choose>\n         <if type=\"bill book graphic legal_case motion_picture report song\" match=\"any\">\n            <text variable=\"title\" form=\"short\" font-style=\"italic\" text-case=\"title\"/>\n         </if>\n         <else>\n            <text variable=\"title\" form=\"short\" quotes=\"true\" text-case=\"title\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"pages\">\n      <choose>\n         <if variable=\"page\">\n            <text variable=\"page\"/>\n         </if>\n         <else>\n            <text value=\"n. pag\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"edition\">\n      <choose>\n         <if is-numeric=\"edition\">\n            <group delimiter=\" \">\n               <number variable=\"edition\" form=\"ordinal\"/>\n               <text term=\"edition\" form=\"short\" suffix=\".\" strip-periods=\"true\"/>\n            </group>\n         </if>\n         <else>\n            <text variable=\"edition\"/>\n         </else>\n      </choose>\n   </macro>\n   <macro name=\"publ