set autocommit=0;
INSERT INTO `@ZEND_DB_TABLE_PREFIX@field_revision_body` VALUES ('node','software_project',0,8,8,'und',0,'Mac OSX os',NULL,'filtered_html'),('node','software_project',0,9,9,'und',0,'Windows 7',NULL,'filtered_html'),('node','bio',0,10,10,'und',0,'Work in gizra inc.',NULL,'filtered_html'),('node','bio',0,11,11,'und',0,'Lou gehrig was a baseball player',NULL,'filtered_html'),('node','bio',0,12,12,'und',0,'Born in Honolulu, Hawaii, Obama is a graduate of Columbia University and Harvard Law School, where he was president of the Harvard Law Review. He was a community organizer in Chicago before earning his law degree. He worked as a civil rights attorney in Chicago and taught constitutional law at the University of Chicago Law School from 1992 to 2004. He served three terms representing the 13th District in the Illinois Senate from 1997 to 2004, running unsuccessfully for the United States House of Representatives in 2000.',NULL,'filtered_html'),('node','bio',0,13,13,'und',0,'was the 16th President of the United States, serving from March 1861 until his assassination in April 1865. Lincoln successfully led the United States through its greatest constitutional, military, and moral crisis—the American Civil War—preserving the Union. Reared in a poor family on the western frontier, Lincoln was mostly self-educated, and became a country lawyer, a Whig Party leader, Illinois state legislator during the 1830s, and a one-term member of the United States House of Representatives during the 1840s.',NULL,'filtered_html'),('node','blog',0,14,14,'und',0,'Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.',NULL,'filtered_html'),('node','blog',0,15,15,'und',0,'Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.',NULL,'filtered_html'),('node','blog',0,16,16,'und',0,'I love michelle with all of my heart. I can\'t describe the way she\'s complete me, the way she see through me. And though, after 20 years together i can only say thanks for michelle for being with me an suffer me each and everey day.',NULL,'filtered_html'),('node','blog',0,17,17,'und',0,'believe that slavery was morally wrong, but there was one big problem: It was sanctioned by the highest law in the land, the Constitution. The nation’s founding fathers, who also struggled with how to address slavery, did not explicitly write the word “slavery” in the Constitution, but they did include key clauses protecting the institution, including a fugitive slave clause and the three-fifths clause, which allowed Southern states to count slaves for the purposes of representation in the federal government. In a three-hour speech in Peoria, Illinois, in the fall of 1854 i presented more clearly than ever my moral,  legal and economic opposition to slavery—and then i admitted i didn\'t knew exactly what should be done about it within the current political system.',NULL,'filtered_html'),('node','blog',0,18,18,'und',0,'Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.',NULL,'filtered_html'),('node','blog',0,19,19,'und',0,'Yesterday I met Mileva, what a nice girl :).',NULL,'filtered_html'),('node','blog',0,20,20,'und',0,'This is an upublished blog',NULL,'filtered_html'),('node','blog',0,21,21,'und',0,'Welcome to Michelle\'s blog.',NULL,'filtered_html'),('node','book',0,22,22,'und',0,'All you need to know about nodes.',NULL,'filtered_html'),('node','book',0,23,23,'und',0,'All about the A.L.S disease',NULL,'filtered_html'),('node','book',0,24,24,'und',0,'All you need to know about terms.',NULL,'filtered_html'),('node','class',0,25,25,'und',0,'This class answer the main question of the semester: who was JFK?.',NULL,'filtered_html'),('node','class',0,26,26,'und',0,'Learn about the first man on the moon.',NULL,'filtered_html'),('node','class',0,27,27,'und',0,'This class answer who was lou gehrig and how he relate to A.L.S.',NULL,'filtered_html'),('node','class',0,28,28,'und',0,'Lorem ipsum',NULL,'filtered_html'),('node','cv',0,29,29,'und',0,'All you need to know about drupal.',NULL,'filtered_html'),('node','cv',0,30,30,'und',0,'All you need to know about baseball',NULL,'filtered_html'),('node','cv',0,31,31,'und',0,'Implement the \'Buffett Rule\'<br />Lower tax rates for middle-income families and corporations<br />Simplify the tax system and consolidate tax brackets<br />Close a loophole that allows companies to shift profits overseas',NULL,'filtered_html'),('node','event',0,32,32,'und',0,'John\'s 96th birthday.',NULL,'filtered_html'),('node','event',0,33,33,'und',0,'Lou\'s 90th birthday',NULL,'filtered_html'),('node','event',0,34,34,'und',0,'The election day in 2016',NULL,'filtered_html'),('node','event',0,35,35,'und',0,'Halley\'s Comet appearing',NULL,'filtered_html'),('node','event',0,36,36,'und',0,'Testing event',NULL,'filtered_html'),('node','faq',0,37,37,'und',0,'JFK stands for: John Fitzgerald Kennedy.',NULL,'filtered_html'),('node','faq',0,38,38,'und',0,'83 Beals Street in Brookline, Massachusetts',NULL,'filtered_html'),('node','feed',0,39,39,'und',0,'Engadget rss feed.',NULL,'filtered_html'),('node','feed',0,40,40,'und',0,'iLoung rss feed',NULL,'filtered_html'),('node','feed',0,41,41,'und',0,'Feeds from around the world',NULL,'filtered_html'),('node','link',0,45,45,'und',0,'John F. kennedy wikipedia page.',NULL,'filtered_html'),('node','link',0,46,46,'und',0,'Lou gehrig wikipedia page.',NULL,'filtered_html'),('node','link',0,47,47,'und',0,'A.L.S wikipedia page',NULL,'filtered_html'),('node','link',0,48,48,'und',0,'The white house home page',NULL,'filtered_html'),('node','link',0,49,49,'und',0,'Barak obama wikipedia page',NULL,'filtered_html'),('node','link',0,50,50,'und',0,'Marilyn Monroe wikipedia page',NULL,'filtered_html'),('node','news',0,51,51,'und',0,'This is a new site generated via the vsite options in open scholar.',NULL,'filtered_html'),('node','news',0,52,52,'und',0,'This is a project generated via the vsite Options in open scholar',NULL,'filtered_html'),('node','news',0,53,53,'und',0,'There are more tests available on the tests list',NULL,'filtered_html'),('node','page',0,54,54,'und',0,'Page about john',NULL,'filtered_html'),('node','page',0,55,55,'und',0,'Page about lincoln',NULL,'filtered_html'),('node','person',0,56,56,'und',0,'often referred to by his initials JFK, was the 35th President of the United States, serving from 1961 until his assassination in 1963.',NULL,'filtered_html'),('node','person',0,57,57,'und',0,'',NULL,'filtered_html'),('node','person',0,58,58,'und',0,'',NULL,'filtered_html'),('node','person',0,59,59,'und',0,'',NULL,'filtered_html'),('node','person',0,60,60,'und',0,'AKA Marilyn Monroe',NULL,'filtered_html'),('node','presentation',0,61,61,'und',0,'Presentation about JFK.',NULL,'filtered_html'),('node','presentation',0,62,62,'und',0,'Is there any solutions for A.L.S? In the presentation we will see which solution are available today.',NULL,'filtered_html'),('node','presentation',0,63,63,'und',0,'ipsum dolor sit',NULL,'filtered_html'),('node','class_material',0,71,71,'und',0,'JFK\'s childhood<br />JFK as president<br />After JFK\'s death, and how it changed USA?',NULL,'filtered_html'),('node','class_material',0,72,72,'und',0,'What cause the disease<br />Famous people and how they dealled with disease',NULL,'filtered_html');
